ITOR'),(6815,9,'QQC'),(6816,1,'APPROVED'),(6817,2,'IDENTIFIER'),(6818,3,'NONE'),(6819,4,'STATIC'),(6820,7,'30'),(6821,8,'\r\n     The data_type element supplies the internal representation and/or\r\n     mathematical properties of a value being stored.  When DATA_TYPE is used\r\n     within a FIELD object definition, its value applies only when the field\r\n     is populated.\r\n      \r\n     Note:  In the PDS, users may find a bit-level description of each data\r\n     type in the Standards Reference document.'),(6822,9,'ASCII_COMPLEX'),(6823,9,'ASCII_INTEGER'),(6824,9,'ASCII_REAL'),(6825,9,'BINARY_CODED_DECIMAL'),(6826,9,'BIT_STRING'),(6827,9,'BOOLEAN'),(6828,9,'CHARACTER'),(6829,9,'COMPLEX'),(6830,9,'DATE'),(6831,9,'EBCDIC_CHARACTER'),(6832,9,'FLOAT'),(6833,9,'IBM_COMPLEX'),(6834,9,'IBM_INTEGER'),(6835,9,'IBM_REAL'),(6836,9,'IBM_UNSIGNED_INTEGER'),(6837,9,'IEEE_COMPLEX'),(6838,9,'IEEE_REAL'),(6839,9,'INTEGER'),(6840,9,'LSB_BIT_STRING'),(6841,9,'LSB_INTEGER'),(6842,9,'LSB_UNSIGNED_INTEGER'),(6843,9,'MAC_COMPLEX'),(6844,9,'MAC_INTEGER'),(6845,9,'MAC_REAL'),(6846,9,'MAC_UNSIGNED_INTEGER'),(6847,9,'MSB_BIT_STRING'),(6848,9,'MSB_INTEGER'),(6849,9,'MSB_UNSIGNED_INTEGER'),(6850,9,'N/A'),(6851,9,'PC_COMPLEX'),(6852,9,'PC_INTEGER'),(6853,9,'PC_REAL'),(6854,9,'PC_UNSIGNED_INTEGER'),(6855,9,'REAL'),(6856,9,'SUN_COMPLEX'),(6857,9,'SUN_INTEGER'),(6858,9,'SUN_REAL'),(6859,9,'SUN_UNSIGNED_INTEGER'),(6860,9,'TIME'),(6861,9,'UNSIGNED_INTEGER'),(6862,9,'VAXG_COMPLEX'),(6863,9,'VAXG_REAL'),(6864,9,'VAX_BIT_STRING'),(6865,9,'VAX_COMPLEX'),(6866,9,'VAX_DOUBLE'),(6867,9,'VAX_INTEGER'),(6868,9,'VAX_REAL'),(6869,9,'VAX_UNSIGNED_INTEGER'),(6870,1,'PROPOSED'),(6871,2,'INTEGER'),(6872,3,'US'),(6873,4,'RANGE'),(6874,5,'0'),(6875,6,'10000000'),(6876,8,'\r\n     Callamp switch on delay measured in\r\n                                         microseconds after START_TIME.\r\n      \r\n                                         Callamp can be switched on before\r\n                                         (< 193000 microseconds`), at\r\n                                         (= 193000 microseconds`), or after\r\n                                         (> 193000 microseconds`) begin of\r\n                                         exposure.'),(6877,1,'PROPOSED'),(6878,2,'REAL'),(6879,3,'NONE'),(6880,4,'RANGE'),(6881,5,'0'),(6882,6,'100'),(6883,8,'\r\n     The callamp can be run at various\r\n                                         duty cycles between 0.0 % and 100.0 % by\r\n                                         using only every other pulse of the\r\n                                         callamp frequency to trigger the callamp.\r\n      \r\n                                         DAWN_CALLAMP_DUTY = CALLAMP_FREQUENCY\r\n                                                             / Value * 100 %\r\n      \r\n                                         Example:\r\n                                         Value = 1.0 : DAWN_CALLAMP_DUTY = 100 %\r\n                                         Value = 2.5 : DAWN_CALLAMP_DUTY = 40 %\r\n      \r\n                                         This calculation is done internally in the\r\n                                         camera, the user  commands the requensted\r\n                                         duty cycle in percentage.'),(6884,1,'PROPOSED'),(6885,2,'CHARACTER'),(6886,3,'N/A'),(6887,4,'STATIC'),(6888,10,'2'),(6889,7,'3'),(6890,8,'\r\n     OFF  callamp set to disabled\r\n      \r\n                                         ON = callamp set to enabled'),(6891,9,'OFF'),(6892,9,'ON'),(6893,1,'PROPOSED'),(6894,2,'REAL'),(6895,3,'KHZ'),(6896,4,'RANGE'),(6897,5,'0'),(6898,6,'250'),(6899,8,'\r\n     The callamp frequency is determined by the\r\n                                         internal 24 MHz clock and an integer\r\n                                         divisor.\r\n      \r\n                                         CALLAMP_FREQUENCY = 24 MHz / Value\r\n      \r\n                                         The standard callamp frequency is 100 kHz\r\n                                         (24MHz / 240).'),(6900,1,'PROPOSED'),(6901,2,'INTEGER'),(6902,3,'US'),(6903,4,'RANGE'),(6904,5,'0'),(6905,6,'10000000'),(6906,8,'\r\n     Callamp strobe time is measured in\r\n                                         microseconds after callamp switch on.\r\n      \r\n                                         callamp switch off time =\r\n                                         START_TIME +\r\n                                         DAWN_CALLAMP_DELAY_TIME +\r\n                                         DAWN_CALLAMP_STROBE_TIME'),(6907,1,'PROPOSED'),(6908,2,'CHARACTER'),(6909,3,'N/A'),(6910,4,'TEXT'),(6911,8,'\r\n     This keyword was used during ground tests\r\n                                         to describe the test environment.'),(6912,1,'PROPOSED'),(6913,2,'CHARACTER'),(6914,3,'N/A'),(6915,4,'STATIC'),(6916,10,'6'),(6917,7,'9'),(6918,8,'\r\n     This keyword describes the priority of the\r\n                                      acquired image and thus how it was handled\r\n                                      on board.\r\n      \r\n                                      Op-Nav = The image is processed with highest\r\n                                      priority and streamed into VR10 of the s/c.\r\n      \r\n                                      Science 1 = The image is processed with high\r\n                                      priority and streamed into VR8 of the s/c.\r\n      \r\n                                      Science 2 = The image is processed with mid\r\n                                      priority and streamed into VR8 of the s/c.\r\n      \r\n                                      Science 3 = The image is processed with low\r\n                                      priority and streamed into VR8 of the s/c.\r\n      \r\n                                      Science 4 = The image is processed with\r\n                                      least priority and streamed into VR8 of the\r\n                                      s/c.'),(6919,9,'OP-NAV'),(6920,9,'SCIENCE 1'),(6921,9,'SCIENCE 2'),(6922,9,'SCIENCE 3'),(6923,9,'SCIENCE 4'),(6924,1,'PROPOSED'),(6925,2,'CHARACTER'),(6926,3,'N/A'),(6927,4,'STATIC'),(6928,10,'4'),(6929,7,'4'),(6930,8,'\r\n     Both DPUs for FC1 and FC2 have the same\r\n                                         DPU ID because they are identical.'),(6931,9,'1.04'),(6932,1,'PROPOSED'),(6933,2,'CHARACTER'),(6934,3,'N/A'),(6935,4,'TEXT'),(6936,10,'4'),(6937,7,'4'),(6938,8,'\r\n     Current version of the FC onboard software'),(6939,1,'PROPOSED'),(6940,2,'CHARACTER'),(6941,3,'N/A'),(6942,4,'STATIC'),(6943,10,'2'),(6944,7,'3'),(6945,8,'\r\n     OFF  FEE is disabled, images cannot be\r\n                                         acquired\r\n      \r\n                                         ON = FEE is enabled, images can be\r\n                                         acquired'),(6946,9,'OFF'),(6947,9,'ON'),(6948,1,'PROPOSED'),(6949,2,'CHARACTER'),(6950,3,'N/A'),(6951,4,'DEFINITION'),(6952,10,'9'),(6953,7,'9'),(6954,8,'\r\n     017.10.10  FEE ID of FC1 (FS1)\r\n      \r\n                                        017.09.09 = FEE ID of FC2 (FM2)\r\n      \r\n                                        063.15.15 indicates that the FEE is off or\r\n                                        busy and cannot transmit its ID.'),(6955,9,'017.09.09'),(6956,9,'017.10.10'),(6957,1,'PROPOSED'),(6958,2,'INTEGER'),(6959,3,'K'),(6960,4,'RANGE'),(6961,5,'0'),(6962,6,'63'),(6963,8,'\r\n     FILTER_NUMBER\r\n                                      (((64 + 4 + encoderOnClearFilter\r\n                                      - FILTER_ENCODER) / 8) MOD 8) + 1\r\n      \r\n                                      encoderOnClearFilter is a hardware-dependent\r\n                                      constant filterEncoder is the current\r\n                                      readout of the encoder filterNumber\r\n                                      return a value in the range [1..8].\r\n      \r\n                                      All the operation are integer operations,\r\n                                      MOD represents modulo and / is the integer\r\n                                      division. The subtraction is negative\r\n                                      (F1 - Fx) because the encoder value\r\n                                      decreases with increasing filter number.'),(6964,1,'APPROVED'),(6965,2,'CHARACTER'),(6966,3,'N/A'),(6967,4,'STATIC'),(6968,7,'30'),(6969,8,'\r\n     This keyword defines the units\r\n        of FRAME_PARAMETER that define the individual frame parameters of\r\n        an instrument that transfers single frames to the mass memory of\r\n        the spacecraft or the instrument. The FRAME_PARAMETER element\r\n        is also accompanied by the element FRAME_PARAMETER_DESC, e.g.\r\n        FRAME_PARAMETER_DESC = (\'EXPOSURE_DURATION\', \'FRAME_SUMMING\'\r\n        \'EXTERNAL_REPETITION_TIME\', \'EXTERNAL DARK_ACQUISITION_RATE\')'),(6970,9,'DIMENSIONLESS'),(6971,9,'S'),(6972,1,'PROPOSED'),(6973,2,'INTEGER'),(6974,3,'K'),(6975,4,'RANGE'),(6976,5,'0'),(6977,6,'63'),(6978,8,'\r\n     The Front Door is closed if\r\n                                         FRONT_DOOR_ENCODER shows the nominal\r\n                                         value +/- 1 and otherwise is open.'),(6979,1,'PROPOSED'),(6980,2,'CHARACTER'),(6981,3,'N/A'),(6982,4,'STATIC'),(6983,10,'4'),(6984,7,'6'),(6985,8,'\r\n     CLOSED  Front Door, covering the\r\n                                         aperture, is closed.\r\n      \r\n                                         DOOR = Front Door is open.'),(6986,9,'CLOSED'),(6987,9,'OPEN'),(6988,1,'PROPOSED'),(6989,2,'CHARACTER'),(6990,3,'N/A'),(6991,4,'STATIC'),(6992,10,'2'),(6993,7,'3'),(6994,8,'\r\n     Fail Safe Actuator:\r\n                                         OFF = The Fail Safe Actuator for the\r\n                                         Front Door i