\n                                        Location: Lens Barrel\r\n                                        H/K Sensor: Lens Barrel Thermistor\r\n                                        Sensor Type: AD590\r\n                                        Gain: 0.9975\r\n                                        Offset: -129.5\r\n                                        Sensor Offset FC1: -1.1\r\n                                        Sensor Offset FC2: -1.1\r\n      \r\n                                        T_LENS_BARREL = DN * Gain + Offset\r\n                                        + Sensor Offset [deg C]\r\n                                        T_LENS_BARREL = DN * Gain + Offset\r\n                                        + Sensor Offset + 273.150 [Kelvin]\r\n      \r\n                                        Lower limit red: -55.0 deg C\r\n                                        Lower limit yellow: -50.0 deg C\r\n                                        Upper limit yellow: +40.0 deg C\r\n                                        Upper limit red: +45.0 deg C'),(7214,1,'PROPOSED'),(7215,2,'REAL'),(7216,3,'K'),(7217,4,'RANGE'),(7218,5,'-999.999'),(7219,6,'999.999'),(7220,8,'\r\n     Name: TRD\r\n                                        Location: Radiator\r\n                                        H/K Sensor: Radiator Thermistor\r\n                                        Sensor Type: AD590\r\n                                        Gain: 0.9975\r\n                                        Offset: -129.5\r\n                                        Sensor Offset FC1: -1.1\r\n                                        Sensor Offset FC2: -1.1\r\n      \r\n                                        T_RAD_MOTOR = DN * Gain + Offset\r\n                                        + Sensor Offset [deg C]\r\n                                        T_RAD_MOTOR = DN * Gain + Offset\r\n                                        + Sensor Offset + 273.150 [Kelvin]\r\n      \r\n                                        Lower limit red: -115.0 deg C\r\n                                        Lower limit yellow: -95.0 deg C\r\n                                        Upper limit yellow: +35.0 deg C\r\n                                        Upper limit red: +40.0 deg C\r\n      \r\n                                        Note: This is not a motor temperature!'),(7221,1,'PROPOSED'),(7222,2,'REAL'),(7223,3,'K'),(7224,4,'RANGE'),(7225,5,'-999.999'),(7226,6,'999.999'),(7227,8,'\r\n     Name: TCS\r\n                                        Location: Camera Head\r\n                                        H/K Sensor: CH Structure Thermistor\r\n                                        Sensor Type: AD590\r\n                                        Gain: 0.9975\r\n                                        Offset: -129.5\r\n                                        Sensor Offset FC1: -3.1\r\n                                        Sensor Offset FC2: -4.1\r\n      \r\n                                        T_STRUCTURE = DN * Gain + Offset\r\n                                        + Sensor Offset [deg C]\r\n                                        T_STRUCTURE = DN * Gain + Offset\r\n                                        + Sensor Offset + 273.150 [Kelvin]\r\n      \r\n                                        Lower limit red: -55.0 deg C\r\n                                        Lower limit yellow: -50.0 deg C\r\n                                        Upper limit yellow: +40.0 deg C\r\n                                        Upper limit red: +45.0 deg C'),(7228,1,'PROPOSED'),(7229,2,'CHARACTER'),(7230,3,'N/A'),(7231,4,'TEXT'),(7232,8,'\r\n     This keyword was used during ground\r\n                                         tests to describe the target the FC\r\n                                         was pointing at during the test'),(7233,1,'PROPOSED'),(7234,2,'CHARACTER'),(7235,3,'N/A'),(7236,4,'TEXT'),(7237,8,'\r\n     This keyword was used during ground\r\n                                         tests to define the lamp that was\r\n                                         used during the test.'),(7238,1,'PROPOSED'),(7239,2,'CHARACTER'),(7240,3,'N/A'),(7241,4,'TEXT'),(7242,10,'7'),(7243,7,'7'),(7244,8,'\r\n     Current version of the FC UDP library'),(7245,1,'PROPOSED'),(7246,2,'CHARACTER'),(7247,3,'N/A'),(7248,4,'STATIC'),(7249,10,'2'),(7250,7,'3'),(7251,8,'\r\n     OFF  No pre-clear of the CCD prior to an\r\n                                         image acquisition.\r\n      \r\n                                         ON = A pre-clear of the CCD, 193 ms prior\r\n                                         to an image acquisition, removes all\r\n                                         charge that is on the CCD at this moment'),(7252,9,'OFF'),(7253,9,'ON'),(7254,1,'PROPOSED'),(7255,2,'REAL'),(7256,3,'V'),(7257,4,'RANGE'),(7258,5,'-9999.99'),(7259,6,'9999.999'),(7260,8,'\r\n     Name: V12FEE\r\n                                        Location: PCU\r\n                                        H/K Sensor: PCU Voltage Monitor\r\n                                        Sensor Type: Voltage Sensor\r\n                                        Gain: 0.0012\r\n                                        Offset: 0\r\n                                        Sensor Offset FC1: 0\r\n                                        Sensor Offset FC2: 0\r\n      \r\n                                        V_12 = DN * Gain + Offset + Sensor Offset\r\n                                               [V]\r\n      \r\n                                        Lower limit red: 11.0 V\r\n                                        Lower limit yellow: 11.7 V\r\n                                        Upper limit yellow: 12.5 V\r\n                                        Upper limit red: 13.0 V'),(7261,1,'PROPOSED'),(7262,2,'REAL'),(7263,3,'V'),(7264,4,'RANGE'),(7265,5,'-9999.99'),(7266,6,'9999.999'),(7267,8,'\r\n     Name: V16V15\r\n                                        Location: PCU\r\n       