(7545,3,'MICRON'),(7546,4,'RANGE'),(7547,5,'0'),(7548,8,'\r\n     The detector_pixel_height element provides the height of a pixel in the\r\n     CCD sensor measured in microns.'),(7549,1,'APPROVED'),(7550,2,'REAL'),(7551,3,'MICRON'),(7552,4,'RANGE'),(7553,5,'0'),(7554,8,'\r\n     The detector_pixel_width element provides the width of a pixel in the\r\n     Charge-Coupled Device (CCD) sensor measured in microns.'),(7555,9,'DS'),(7556,9,'DSIM'),(7557,9,'DSIMNS'),(7558,9,'DSNS'),(7559,9,'IM'),(7560,9,'IMNS'),(7561,9,'NONE'),(7562,9,'NS'),(7563,1,'APPROVED'),(7564,2,'REAL'),(7565,3,'K'),(7566,4,'RANGE'),(7567,5,'0'),(7568,8,'\r\n     The DETECTOR_TEMPERATURE is the temperature that the instrument\r\n     (detector) operated at while a measurement was made. The importance for\r\n     Viking Lander is that the radiometric calibration is slightly dependent\r\n     on detector temperature.'),(7569,1,'PENDING'),(7570,2,'REAL'),(7571,3,'DEG'),(7572,4,'SUGGESTED'),(7573,8,'\r\n     The DETECTOR_TO_IMAGE_ROTATION element provides the clockwise rotation,\r\n     in degrees, that was applied to an image along its optical path through\r\n     an instrument, from detector to final image orientation.'),(7574,9,'0.0'),(7575,9,'180.0'),(7576,9,'270.0'),(7577,9,'90.0'),(7578,1,'APPROVED'),(7579,2,'IDENTIFIER'),(7580,3,'NONE'),(7581,4,'DYNAMIC'),(7582,7,'20'),(7583,8,'\r\n     The detector_type element identifies the type of an\r\n     instrument\'s detector.\r\n     Example values: SI CCD, INSB, GE, VIDICON, PHOTODIODE.'),(7584,9,'ANTENNA'),(7585,9,'CHARGE_INJECTION_DEV'),(7586,9,'DIPOLE_ANTENNA'),(7587,9,'FARADAY_CUP'),(7588,9,'HG:GE'),(7589,9,'HOT-FILM_ANEMOMETER'),(7590,9,'LINE_ARRAY'),(7591,9,'MCT'),(7592,9,'MONOPOLE_PR_ANTENNA'),(7593,9,'N/A'),(7594,9,'PBS'),(7595,9,'PBSE'),(7596,9,'RESIST_THERMOMETER'),(7597,9,'RING_CORE'),(7598,9,'SOLID_STATE'),(7599,9,'THERMISTOR'),(7600,9,'THERMOCOUPLE'),(7601,9,'THERMOPILE_ARRAY'),(7602,9,'VARIABLE_RELUCTANCE'),(7603,9,'VIDICON'),(7604,1,'APPROVED'),(7605,2,'INTEGER'),(7606,3,'NONE'),(7607,4,'RANGE'),(7608,5,'0'),(7609,8,'\r\n     The detectors element provides the number of detectors of a\r\n     specified type contained in the subject instrument.'),(7610,1,'APPROVED'),(7611,2,'CHARACTER'),(7612,3,'NONE'),(7613,4,'STATIC'),(7614,7,'1'),(7615,8,'\r\n      The diffraction_corrected_flag element is a yes-or-no flag\r\n     that indicates whether a ring occultation data product has\r\n     been corrected for diffraction.  In general, it equals \'N\'\r\n     for stellar occultation but data may equal \'Y\' or \'N\' for\r\n     radio occultation data, depending on the processing.  If\r\n     the data product has been corrected for diffraction, then\r\n     the radres element specifies the processing\r\n     resolution.'),(7616,9,'N'),(7617,9,'Y'),(7618,1,'APPROVED'),(7619,2,'CHARACTER'),(7620,3,'NONE'),(7621,4,'TEXT'),(7622,8,'\r\n     The discipline_desc element describes the discipline\r\n     identified by the discipline_name element.'),(7623,1,'APPROVED'),(7624,2,'CHARACTER'),(7625,3,'NONE'),(7626,4,'STATIC'),(7627,7,'30'),(7628,8,'\r\n     The discipline_name element identifies the major academic\r\n     or scientific domain or specialty of interest to an\r\n     individual or to a PDS Node.'),(7629,9,'ATMOSPHERES'),(7630,9,'GEOSCIENCES'),(7631,9,'IMAGE PROCESSING'),(7632,9,'IMAGING SPECTROSCOPY'),(7633,9,'NAVIGATION ANCILLARY INFORMATION FACILITY'),(7634,9,'PLASMA INTERACTIONS'),(7635,9,'RADIOMETRY'),(7636,9,'RINGS'),(7637,9,'SMALL BODIES'),(7638,1,'APPROVED'),(7639,2,'IDENTIFIER'),(7640,3,'NONE'),(7641,4,'DYNAMIC'),(7642,10,'3'),(7643,7,'4'),(7644,8,'\r\n     The DISPERSION_MODE_ID element describes the dispersion mode selected\r\n     for a spectrograph.\r\n     Note:  For the International Ultraviolet Explorer (IUE)\r\n     spacecraft, the spectrographs can operate in a low (2.64\r\n     Angstrom/pix for Long-Wavelength Primary (LWP) and 1.67 A/pix for\r\n     Short-Wavelength Primary (SWP)) or high (7.22 km/sec/pix for LWP and\r\n     7.70 km/sec/pix for SWP) dispersion mode.'),(7645,9,'HIGH'),(7646,9,'LOW'),(7647,1,'APPROVED'),(7648,2,'CHARACTER'),(7649,3,'NONE'),(7650,4,'NONE'),(7651,7,'12'),(7652,8,'\r\n     The display_format element provides display format\r\n     information to software that formats data to an output\r\n     device.  Valid format types include DATE(x) where X is the\r\n     number of digits in a date.  Usually DATE(6) (YYYY-MM) or\r\n     DATE(8) (YYYY-MM-DD).  TIME(X) where X is the number of\r\n     digits in a time statement.  This is usually represented as\r\n     TIME(6) (HH:MM:SS) or TIME(4) (HH:MM)>  DATETIME is used\r\n     for UTC system format date-times (MM-DD-YYYYTHH:MM:SS.HHH). JUSTLEFT is\r\n     used for left-justified character strings, and JUSTRIGHT is\r\n     used for right justification.  DIGIT(X) is used where X is\r\n     the number of digits in an integer, so 897 would be\r\n     DIGIT(3).  SCI(X,Y) is used where X is the number of\r\n     significant digits before the decimal in scientific\r\n     notation, and Y is the number following the decimal, so\r\n     1.293E-2 would be SCI(1,3).  FLOAT(X) is used where X is the\r\n     total number of digits in a floating point number, so\r\n     33.018746 would be FLOAT(8).  USDOLLAR is used for monetary\r\n     amounts in the indicated currency, PHONE is used for\r\n     telephone numbers, and FTSPHONE is used for seven-digit\r\n     numbers in the Federal Telephone System.'),(7653,1,'APPROVED'),(7654,2,'CHARACTER'),(7655,3,'NONE'),(7656,4,'TEXT'),(7657,8,'\r\n     The DISTRIBUTION_TYPE element identifies the type or\r\n     category of a data product within a data set release.'),(7658,1,'APPROVED'),(7659,2,'CHARACTER'),(7660,3,'NONE'),(7661,4,'DYNAMIC'),(7662,7,'60'),(7663,8,'\r\n     The document_format element represents the manner in which\r\n     documents are stored, such as TEX, POSTSCRIPT, TIFF, etc.\r\n     Version numbers for these formats should be included when\r\n     appropriate, such as \'WORDPERFECT 5.0\'.'),(7664,9,'ADOBE PDF'),(7665,9,'ENCAPSULATED POSTSCRIPT'),(7666,9,'GIF'),(7667,9,'HTML'),(7668,9,'JPG'),(7669,9,'LATEX'),(7670,9,'MICROSOFT WORD'),(7671,9,'PNG'),(7672,9,'POSTSCRIPT'),(7673,9,'RICH TEXT'),(7674,9,'TEXT'),(7675,9,'TIFF'),(7676,1,'APPROVED'),(7677,2,'CHARACTER'),(7678,3,'NONE'),(7679,4,'DEFINITION'),(7680,7,'120'),(7681,8,'\r\n     The document_name element provides the name of a document.'),(7682,1,'APPROVED'),(7683,2,'CHARACTER'),(7684,3,'NONE'),(7685,4,'SUGGESTED'),(7686,7,'60'),(7687,8,'\r\n     COLUMN_VALUE  SPACECRAFT'),(7688,9,'ARCHIVE VOLUME SIS'),(7689,9,'ASTEROID INFORMATION'),(7690,9,'ASTEROID POLE POSITIONS'),(7691,9,'ASTEROID REFLECTANCE SPECTRA'),(7692,9,'BROWSE DATA'),(7693,9,'BROWSE IMAGE'),(7694,9,'CALIBRATION DESCRIPTION'),(7695,9,'CALIBRATION REPORT'),(7696,9,'CARTOGRAPHY'),(7697,9,'COMET HALLEY'),(7698,9,'COMETS'),(7699,9,'CRS DOCUMENTATION'),(7700,9,'CRS NEPTUNE ANALYSIS'),(7701,9,'CRS NEPTUNE REPORT'),(7702,9,'CRS URANUS ANALYSIS'),(7703,9,'CRS URANUS REPORT'),(7704,9,'CURRENTS IN SATURN\'S MAGNETOSPHERE'),(7705,9,'DATA ANALYSIS'),(7706,9,'DATA PRODUCT SIS'),(7707,9,'DATA RECOVERY TECHNIQUES AND ANALYSIS'),(7708,9,'DATA SET DERIVATION AND INTERPRETATIONS'),(7709,9,'DATA SET DESCRIPTION'),(7710,9,'DATA SET DESCRIPTION, DERIVATION TECHNIQUE, AND ANALYSIS'),(7711,9,'DATA SET DESCRIPTION, DERIVATION, AND INTERPRETATIONS'),(7712,9,'DATA USER REQUIREMENTS'),(7713,9,'DERIVATION AND ANALYSIS TECHNIQUES'),(7714,9,'ENERGETIC PARTICLES AT JUPITER'),(7715,9,'ENERGETIC PARTICLES AT NEPTUNE'),(7716,9,'ENERGETIC PARTICLES AT URANUS'),(7717,9,'EXPERIMENT RESULTS'),(7718,9,'FUNCTIONAL REQUIREMENTS DOCUMENT'),(7719,9,'GEOLOGY'),(7720,9,'GEOLOGY OF VENUS'),(7721,9,'GRSFE'),(7722,9,'HTML NAVIGATION'),(7723,9,'ICD'),(7724,9,'IHW LSPN ATLAS'),(7725,9,'IHW STUDY'),(7726,9,'IMAGE PROCESSING'),(7727,9,'INITIAL EXPERIMENT RESULTS'),(7728,9,'INSTRUMENT AND DATA SET DESCRIPTION'),(7729,9,'INSTRUMENT DES