LRE RDR data product.'),(13109,1,'APPROVED'),(13110,2,'REAL'),(13111,3,'NONE'),(13112,4,'RANGE'),(13113,7,'10'),(13114,8,'\r\n          The LRO:DLRE_VLOOKZ_MAX element gives the maximum recorded\r\n          value of the Z component of the Diviner Look Unit Vector\r\n          in a DLRE RDR data product.'),(13115,1,'APPROVED'),(13116,2,'REAL'),(13117,3,'NONE'),(13118,4,'RANGE'),(13119,7,'10'),(13120,8,'\r\n          The LRO:DLRE_VLOOKZ_MAX element gives the maximum recorded\r\n          value of the Z component of the Diviner Look Unit Vector\r\n          in a DLRE RDR data product.'),(13121,1,'APPROVED'),(13122,2,'REAL'),(13123,3,'NONE'),(13124,4,'RANGE'),(13125,7,'10'),(13126,8,'\r\n          The LRO:DLRE_VLOOKZ_MAX element gives the maximum recorded\r\n          value of the Z component of the Diviner Look Unit Vector\r\n          in a DLRE RDR data product.'),(13127,1,'APPROVED'),(13128,2,'REAL'),(13129,3,'NONE'),(13130,4,'RANGE'),(13131,7,'10'),(13132,8,'\r\n          The LRO:DLRE_VLOOKZ_MAX element gives the maximum recorded\r\n          value of the Z component of the Diviner Look Unit Vector\r\n          in a DLRE RDR data product.'),(13133,1,'APPROVED'),(13134,2,'REAL'),(13135,3,'NONE'),(13136,4,'RANGE'),(13137,7,'10'),(13138,8,'\r\n          The LRO:DLRE_VLOOKZ_MAX element gives the maximum recorded\r\n          value of the Z component of the Diviner Look Unit Vector\r\n          in a DLRE RDR data product.'),(13139,1,'APPROVED'),(13140,2,'INTEGER'),(13141,3,'NONE'),(13142,4,'RANGE'),(13143,5,'0'),(13144,7,'10'),(13145,8,'\r\n          The LAST_AZIMUTH_COMMAND_MAX element gives the maximum value of the\r\n          last azimuth command in the set of observations that make up a\r\n          Diviner data product.'),(13146,1,'APPROVED'),(13147,2,'INTEGER'),(13148,3,'NONE'),(13149,4,'RANGE'),(13150,5,'0'),(13151,7,'10'),(13152,8,'\r\n          The LAST_AZIMUTH_COMMAND_MAX element gives the maximum value of the\r\n          last azimuth command in the set of observations that make up a\r\n          Diviner data product.'),(13153,1,'APPROVED'),(13154,2,'INTEGER'),(13155,3,'NONE'),(13156,4,'RANGE'),(13157,5,'0'),(13158,7,'10'),(13159,8,'\r\n          The LAST_ELEVATION_COMMAND_MAX element gives the maximum value of the\r\n          last elevation command in the set of observations that make up\r\n          a Diviner data product.'),(13160,1,'APPROVED'),(13161,2,'INTEGER'),(13162,3,'NONE'),(13163,4,'RANGE'),(13164,5,'0'),(13165,7,'10'),(13166,8,'\r\n          The LAST_ELEVATION_COMMAND_MAX element gives the maximum value of the\r\n          last elevation command in the set of observations that make up\r\n          a Diviner data product.'),(13167,1,'APPROVED'),(13168,2,'CHARACTER'),(13169,3,'NONE'),(13170,4,'TEXT'),(13171,7,'10'),(13172,8,'\r\n         The LOLA_DEM_VERS element gives the version of the LOLA digital elevation\r\n         model that was used to locate Diviner footprints for the generation of a\r\n         Diviner GDR product. Example value: 1.0.'),(13173,1,'APPROVED'),(13174,2,'REAL'),(13175,3,'DEG'),(13176,4,'RANGE'),(13177,5,'0'),(13178,6,'359'),(13179,8,'\r\n       The lro:look_azimuth_angle element is the East-West look azimuth\r\n       discrimination angle. This is the angle between the projection of North\r\n       into the tangent plane of a sphere at the image center point and the\r\n       vector from subspacecraft point to the image center projected into the\r\n       plane. It assumes values from 0 to 360, where 0 means North-looking,\r\n       90 East-looking, 180 South-looking, and 270 West-looking.'),(13180,1,'APPROVED'),(13181,2,'INTEGER'),(13182,3,'NONE'),(13183,4,'RANGE'),(13184,5,'0'),(13185,6,'1023'),(13186,7,'10'),(13187,8,'\r\n          The LRO:MAXIMUM_STRETCH element provides contrast stretch values to\r\n          be used in the display of a LROC Image. The LRO:MAXIMUM_STRETCH\r\n          parameter specifies the DN value to map to the 255 DN value of the\r\n          display. For color images, there will be three values, one for each\r\n          color.'),(13188,1,'APPROVED'),(13189,2,'INTEGER'),(13190,3,'NONE'),(13191,4,'RANGE'),(13192,5,'0'),(13193,6,'1023'),(13194,7,'10'),(13195,8,'\r\n          The LRO:MINIMUM_STRETCH element provides contrast stretch values to\r\n          be used in the display of a LROC Image. The LRO:MINIMUM_STRETCH\r\n          parameter is the minimum DN value to map to the 0 DN value of the\r\n          display. For color images, there will be three values, one for each\r\n          color.'),(13196,1,'APPROVED'),(13197,2,'INTEGER'),(13198,3,'NONE'),(13199,4,'RANGE'),(13200,5,'0'),(13201,7,'10'),(13202,8,'\r\n          The LRO:PARTIAL_LINES element gives the number of lines of data in\r\n          a data product that contain partial but incomplete data.'),(13203,1,'APPROVED'),(13204,2,'CONTEXT_DEPENDENT'),(13205,3,'NONE'),(13206,4,'FORMATION'),(13207,5,'-450'),(13208,6,'450'),(13209,7,'10'),(13210,8,'\r\n          Each inner vector (row) of the RANGE_COEFFICIENT_SET element contains a\r\n          time and a set of 4 polynomial coefficients used for resampling slant\r\n          range (in meters) to approximate ground range (in meters) at that time.\r\n          Formation rule:\r\n          ( (Ta, C1a, C2a, C3a, C4a), (Tb, C1b, C2b, C3b, C4b), ... )\r\n          where Tx is a date-time string in the format yyyy-mm-ddThh:mm:ss.mmm,\r\n          inside double quotation marks, and C1 through C4 are polynomial\r\n          coefficients in floating-point or exponential notation. This five-tuple\r\n          is enclosed in parentheses, and may be followed by more five-tuples in\r\n          the same pattern, separated by commas. The set of all five-tuples is\r\n          enclosed in parentheses.'),(13211,1,'APPROVED'),(13212,2,'REAL'),(13213,3,'KM'),(13214,4,'RANGE'),(13215,5,'0'),(13216,6,'450'),(13217,7,'10'),(13218,8,'\r\n          The true resolution of the radar image in the range (across track)\r\n          direction, evaluated at the center of the image for the transmit,\r\n          receive, and processing parameters used for the sequence.'),(13219,1,'APPROVED'),(13220,2,'CHARACTER'),(13221,3,'NONE'),(13222,4,'FORMATION'),(13223,5,'0'),(13224,6,'1023'),(13225,7,'40'),(13226,8,'\r\n          The LRO:stcf_file_name element provides the name of the LRO Spacecraft\r\n          Time Correlation file, which is a housekeeping file containing the\r\n          offset between the spacecraft raw clock and terrestrial time. The time\r\n          correlation file is used to compute the start and stop spacecraft clock\r\n          times for LOLA data products.'),(13227,1,'APPROVED'),(13228,2,'INTEGER'),(13229,3,'NONE'),(13230,4,'RANGE'),(13231,5,'0'),(13232,7,'10'),(13233,8,'\r\n          The LRO:TOTAL_LINES element gives the total number of lines of data in\r\n          a data product, including both complete lines and partial lines.'),(13234,1,'APPROVED'),(13235,2,'INTEGER'),(13236,3,'NONE'),(13237,4,'RANGE'),(13238,5,'1'),(13239,8,'\r\n     The MACROPIXEL_SIZE element provides the sampling array size (e.g., 2x2,\r\n     4x4, 8x8), in pixels, that is used to reduce the amount of data an image\r\n     contains by summing the values of the pixels, along the lines of the image.\r\n     This process may be performed for images with increased exposure times in\r\n     flight direction. Also known as summation mode.'),(13240,1,'PENDING'),(13241,2,'CHARACTER'),(13242,3,'N/A'),(13243,4,'SUGGESTED'),(13244,8,'\r\n     The MAGNET_ID element identifies a magnet instrument\r\n     that is visible in an image or observation.'),(13245,9,'CAPTURE'),(13246,9,'FILTER'),(13247,9,'N/A'),(13248,9,'NULL'),(13249,9,'RAT'),(13250,9,'SWEEP'),(13251,9,'UNK'),(13252,1,'APPROVED'),(13253,2,'REAL'),(13254,3,'J/T'),(13255,4,'RANGE'),(13256,8,'\r\n     The magnetic_moment element provides the value of the\r\n     magnetic moment of a target body.'),(13257,1,'APPROVED'),(13258,2,'CHARACTER'),(13259,3,'NONE'),(13260,4,'NONE'),(13261,8,'\r\n     The mailing_address_line element provides one line\r\n     of the mailing address of an individual or institution.\r\n     The ordering of the mailing address lines is provided by\r\n     the associated tuple_sequence_number.'),(13262,1,'APPROVED'),(13263,2,'CHARACTER'),(13264,3,'NONE'),(13265,4,'NONE'),(13266,7,'1'),(13267,8,'\r\n     The mandatory_column element denotes whether an attribute\r\n     may be set to a null value.  Example:  Y or N'),(13268,1,'APPROVED'),(13269,2,'CHARACTER'),(13270,3,'NONE'),(13271,4,'TEXT'),(13272,8,'\r\n     The map_desc element describes the contents and\r\n     processing history of a given map.'),(13273,1,'APPROVED'),(13274,2,'CHARACTER'),(13275,3,'NONE'),(13276,4,'NONE'),(13277,7,'40'),(13278,8,'\r\n     The map_name element provides the name assigned to a map,\r\n     and typically corresponds to the name of a prominent\r\n     feature which appears on the map.\r\n     Note:  This element is also used within AMMOS as a unique\r\n     identifier for decommutation maps.'),(13279,1,'APPROVED'),(13280,2,'CHARACTER'),(13281,3,'NONE'),(13282,4,'NONE'),(13283,7,'20'),(13284,8,'\r\n     The map_number element provides a numeric identifier for a\r\n     given map.'),(13285,1,'APPROVED'),(13286,2,'CHARACTER'),(13287,3,'NONE'),(13288,4,'TEXT'),(13289,8,'\r\n     The map_projection_desc element describes the\r\n     map_projection_type unambiguously.  It shall contain the\r\n     mathematical expressions (it may even contain the source\r\n     code or pseudo code, with comments) and any assumptions\r\n     (e.g. the  planet is assumed spherical).  Additionally it\r\n     shall describe the  planet eccentricity, the treatment of\r\n     the a_axis_radius, b_axis_radius,  and c_axis_radius when\r\n     the projection was created, and where the  map_scale (or\r\n     map_resolution) is defined.'),(13290,1,'APPROVED'),(13291,2,'REAL'),(13292,3,'DEG'),(13293,4,'RANGE'),(13294,5,'0'),(13295,6,'180'),(13296,8,'\r\n     The map_projection_rotation element provides the clockwise\r\n     rotation, in degrees, of the line and sample coordinates\r\n     with respect to the map projection origin\r\n     (line_projection_offset, line_projection_offset)  This\r\n     parameter is used to indicate where \'up\' is in the\r\n     projection.  For example, in a polar stereographic\r\n     projection does the zero meridian go center to bottom,\r\n     center to top, center to left, or center to right?  The\r\n     polar projection is defined such that the zero meridian\r\n     goes center to bottom. However, by rotating the map\r\n     projection, the zero meridian can go in any direction.\r\n     Note: 180 degrees is at the top of the North Pole and 0\r\n     degrees is at the top of the South Pole.  For example, if 0\r\n     degrees is at the top of the North Pole than the\r\n     map_projection_rotation would be 180 degrees.'),(13297,1,'APPROVED'),(13298,2,'CHARACTER'),(13299,3,'NONE'),(13300,4,'DYNAMIC'),(13301,7,'28'),(13302,8,'\r\n     The map_projection_type element identifies the type of projection\r\n     characteristic of a given map.  Example value: ORTHOGRAPHIC.'),(13303,9,'AITOFF'),(13304,9,'ALBERS'),(13305,9,'BONNE'),(13306,9,'BRIESEMEISTER'),(13307,9,'CYLINDRICAL EQUAL AREA'),(13308,9,'EQUIDISTANT'),(13309,9,'EQUIRECTANGULAR'),(13310,9,'GNOMONIC'),(13311,9,'HAMMER'),(13312,9,'HENDU'),(13313,9,'LAMBERT AZIMUTHAL EQUAL AREA'),(13314,9,'LAMBERT CONFORMAL'),(13315,9,'MERCATOR'),(13316,9,'MOLLWEIDE'),(13317,9,'OBLIQUE CYLINDRICAL'),(13318,9,'ORTHOGRAPHIC'),(13319,9,'POLAR STEREOGRAPHIC'),(13320,9,'SIMPLE CYLINDRICAL'),(13321,9,'SINUSOIDAL'),(13322,9,'STEREOGRAPHIC'),(13323,9,'TRANSVERSE MERCATOR'),(13324,9,'VAN DER GRINTEN'),(13325,9,'WERNER'),(13326,1,'APPROVED'),(13327,2,'REAL'),(13328,3,'PIX/DEG'),(13329,4,'RANGE'),(13330,5,'0'),(13331,8,'\r\n     The map_resolution element identifies the scale of a given\r\n     map.  Please refer to the definition for map_scale for a\r\n     more complete definition.\r\n     Note: map_resolution and map_scale both define the scale\r\n     of a map except that they are expressed in different\r\n     units:  map_resolution is in PIXEL/DEGREE and\r\n     map_scale is in KM/PIXEL.'),(13332,1,'APPROVED'),(13333,2,'REAL'),(13334,3,'KM/PIX'),(13335,4,'RANGE'),(13336,8,'\r\n     The map_scale element identifies the scale of a given map.\r\n     The scale is defined as the ratio of the actual distance\r\n     between two points on the surface of the target body to the\r\n     distance between the corresponding points on the map.\r\n     The map_scale references the scale of a map at a certain\r\n     reference point or line.  Certain map projections\r\n     vary in scale throughout the map.  For example, in a\r\n     Mercator projection, the map_scale refers to the scale of\r\n     the map at the equator.  For Conic projections, the\r\n     map_scale refers to the scale at the standard parallels.\r\n     For an Orthographic point, the map_scale refers to the scale\r\n     at the center latitude and longitude.  The relationship\r\n     between map_scale and the map_resolution element is that\r\n     they both define the scale of a given map, except they are\r\n     expressed in different units:  map_scale is in KM/PIXEL\r\n     and map_resolution is in PIXEL/DEGREE.  Also note that one\r\n     is inversely proportional to the other and that kilometers and degrees\r\n     can be related given the radius of the planet:  1 degree =\r\n     (2 * RADIUS * PI) / 360 kilometers.'),(13337,1,'APPROVED'),(13338,2,'INTEGER'),(13339,3,'NONE'),(13340,4,'RANGE'),(13341,5,'0'),(13342,8,'\r\n     The map_sequence_number element identifies the sequence\r\n     number of a particular series of decommutation maps.'),(13343,1,'APPROVED'),(13344,2,'CHARACTER'),(13345,3,'NONE'),(13346,4,'NONE'),(13347,7,'20'),(13348,8,'\r\n     The map_series_id element identifies a map\r\n     series (as specified by the agency which issued the map).'),(13349,1,'APPROVED'),(13350,2,'INTEGER'),(13351,3,'NONE'),(13352,4,'RANGE'),(13353,5,'0'),(13354,8,'\r\n     The map_sheet_number element provides the sequence number\r\n     of a map which comprises multiple sheets.'),(13355,1,'APPROVED'),(13356,2,'CHARACTER'),(13357,3,'NONE'),(13358,4,'NONE'),(13359,7,'20'),(13360,8,'\r\n     The map_type element identifies the general type of\r\n     information depicted on a given map.\r\n     Example values:  GEOLOGIC, TOPOGRAPHIC, SHADED_RELIEF.'),(13361,1,'APPROVED'),(13362,2,'TIME'),(13363,3,'NONE'),(13364,4,'DYNAMIC'),(13365,7,'30'),(13366,8,'\r\n     The mapping_start_time element is an alias for start_time\r\n     used exclusively by AMMOS-MGN ephemeris files.'),(13367,1,'APPROVED'),(13368,2,'TIME'),(13369,3,'NONE'),(13370,4,'DYNAMIC'),(13371,7,'30'),(13372,8,'\r\n     The mapping_stop_time element is an alias for stop_time used\r\n     exclusively by AMMOS-MGN ephemeris files.'),(13373,1,'APPROVED'),(13374,2,'REAL'),(13375,3,'KG'),(13376,4,'RANGE'),(13377,8,'\r\n     The mass element provides the estimated mass of a target\r\n     body.'),(13378,1,'APPROVED'),(13379,2,'REAL'),(13380,3,'G/CM**3'),(13381,4,'RANGE'),(13382,8,'\r\n     The mass_density element provides the bulk density (mass\r\n     per unit volume) of a target body.  Bulk density is defined\r\n     as the ratio of total mass to total volume.'),(13383,1,'PENDING'),(13384,2,'INTEGER'),(13385,3,'N/A'),(13386,4,'SUGGESTED'),(13387,5,'0'),(13388,6,'10'),(13389,8,'\r\n     The MAX_AUTO_EXPOS_ITERATION_COUNT element specifies the maximum number of\r\n     exposure iterations the instrument will perform in order to obtain the\r\n     requested exposure when operating in an autonomous mode.'),(13390,1,'APPROVED'),(13391,2,'CONTEXTDEPENDENT'),(13392,3,'NONE'),(13393,4,'RANGE'),(13394,7,'20'),(13395,8,'\r\n     The maximum element indicates the largest value occurring\r\n     in a given instance of the data object.\r\n     Note:  For PDS and Mars Observer applications -- because of\r\n     the unconventional data type of this data element, the\r\n     element should appear in labels only within an explicit\r\n     object, i.e. anywhere between an \'OBJECT =\' and an\r\n     \'END_OBJECT\'.'),(13396,1,'PENDING'),(13397,2,'REAL'),(13398,3,'RAD/S'),(13399,4,'SUGGESTED'),(13400,8,'\r\n     The element MAXIMUM_ANGULAR_VELOCITY specifies the\r\n     maximum revolve velocity output of the torque controller\r\n     for the scan and grind portion of the command.'),(13401,1,'APPROVED'),(13402,2,'REAL'),(13403,3,'DEG'),(13404,4,'NONE'),(13405,5,'0'),(13406,6,'360'),(13407,8,'\r\n      The maximum_B1950_ring_longitude element specifies the\r\n     maximum inertial longitude within a ring area relative to\r\n     the B1950 prime meridian, rather than to the J2000 prime\r\n     meridian.  The prime meridian is the ascending node of the\r\n     planet\'s invariable plane on the Earth\'s mean equator of\r\n     B1950.  Longitudes are measured in the direction of orbital\r\n     motion along the planet\'s invariable plane to the ring\'s\r\n     ascending node, and thence along the ring plane.\r\n     Note:  For areas that cross the prime meridian, the maximum\r\n     ring longitude will have a value less than the minimum ring\r\n     longitude.'),(13408,1,'APPROVED'),(13409,2,'REAL'),(13410,3,'K'),(13411,4,'RANGE'),(13412,5,'2.4'),(13413,8,'\r\n     The maximum_brightness_temperature element provides the\r\n     maximum brightness temperature value measured within a given\r\n      set of data or a given sequence.\r\n     Brightness temperature is the temperature of aideal\r\n     blackbody whose radiant energy in a particular wavelength\r\n     range is the same as that of an observed object or feature.'),(13414,1,'APPROVED'),(13415,2,'CHARACTER'),(13416,3,'NONE'),(13417,4,'NONE'),(13418,7,'4'),(13419,8,'\r\n     The maximum_channel_id element identifies the highest channel from which\r\n     data were obtained.  For example, the Voyager PLS instrument reported\r\n     measurements in a number of energy/charge channels.  But not all channel\r\n     values were reported to Earth; the maximum_channel_id element indicated\r\n     the highest energy reported in the telemetry stream.'),(13420,1,'APPROVED'),(13421,2,'REAL'),(13422,3,'NONE'),(13423,4,'RANGE'),(13424,8,'\r\n     The maximum_column_value element provides the maximum real\r\n     value currently allowed by the PDS catalog for a given table\r\n     element.  This value is updated when new limits are\r\n     discovered.\r\n     Note: These elements are unique to a table and may have\r\n     different values depending on which table the element is\r\n     associated with.'),(13425,1,'APPROVED'),(13426,2,'INTEGER'),(13427,3,'NONE'),(13428,4,'RANGE'),(13429,5,'0'),(13430,6,'480'),(13431,8,'\r\n     The MAXIMUM_CURRENT_PERSISTENCE element gives the value of the\r\n     persistence of the maximum current.'),(13432,1,'PENDING'),(13433,2,'REAL'),(13434,3,'DEG'),(13435,4,'SUGGESTED'),(13436,8,'\r\n     The MAXIMUM_ELEVATION element provides the elevation (as defined by the\r\n     coordinate system) of the first line of the image. (MIPL Projections -\r\n     Cylindrical)'),(13437,1,'APPROVED'),(13438,2,'REAL'),(13439,3,'DEG'),(13440,4,'RANGE'),(13441,5,'0'),(13442,6,'180'),(13443,8,'\r\n     The maximum_emission_angle element provides the maximum\r\n     emission angle value.  See emission_angle.'),(13444,1,'APPROVED'),(13445,2,'REAL'),(13446,3,'DEG'),(13447,4,'RANGE'),(13448,5,'0'),(13449,6,'180'),(13450,8,'\r\n     The maximum_incidence_angle element provides the maximum\r\n     incidence angle value.  See incidence_angle.'),(13451,1,'APPROVED'),(13452,2,'REAL'),(13453,3,'MS'),(13454,4,'RANGE'),(13455,8,'\r\n     The maximum_instrument_exposure_duration element provides\r\n     the maximum possible exposure time for the instrument mode\r\n     identified by the instrument_mode_id element.\r\n     See instrument_exposure_duration.'),(13456,1,'APPROVED'),(13457,2,'REAL'),(13458,3,'NONE'),(13459,4,'RANGE'),(13460,8,'\r\n     The maximum_instrument_parameter element provides an\r\n     instrument\'s maximum usefully detectable signal level for\r\n     a given instrument parameter.  This value indicates the\r\n     physical value corresponding to the maximum output of an\r\n     instrument by the instrument_parameter_name element.'),(13461,1,'APPROVED'),(13462,2,'REAL'),(13463,3,'DEG'),(13464,4,'RANGE'),(13465,5,'-273'),(13466,8,'\r\n     The maximum instrument_temperature element provides the maximum\r\n     temperature, in degrees Celcius, of an instrument or some part\r\n     of an instrument.\r\n      \r\n     NOTE:  for MEX, the INSTRUMENT_TEMPERATURE,MAXIMUM_INSTRUMENT_TEMPERATURE,\r\n     and INSTRUMENT_POINT shall always go together and describe the actual\r\n     temperatures of a part of the instrument and its maximum.  For example,\r\n      \r\n             INSTRUMENT_TEMPERATURE         = (10.2, 11.2)\r\n             MAXIMUM_INSTRUMENT_TEMPERATURE = (N/A, 22.2)\r\n             INSTRUMENT_POINT               = (SPECTROMETER, FOCAL_PLANE)'),(13467,1,'APPROVED'),(13468,2,'REAL'),(13469,3,'DEG'),(13470,4,'RANGE'),(13471,5,'-90'),(13472,6,'90'),(13473,8,'\r\n     The maximum_latitude element specifies the northernmost\r\n     latitude of a spatial area, such as a map, mosaic, bin,\r\n     feature, or region.  See latitude.'),(13474,1,'APPROVED'),(13475,2,'INTEGER'),(13476,3,'NONE'),(13477,4,'RANGE'),(13478,5,'1'),(13479,8,'\r\n     The maximum_length element supplies the maximum number of\r\n     units associated with the representation of a data element.'),(13480,1,'APPROVED'),(13481,2,'REAL'),(13482,3,'DEG'),(13483,4,'RANGE'),(13484,5,'-90'),(13485,6,'90'),(13486,8,'\r\n     The maximum_limb_angle element provides the maximum value\r\n     of the limb angle within a given set of data.  See\r\n     limb_angle.'),(13487,1,'APPROVED'),(13488,2,'REAL'),(13489,3,'LOCALDAY/24'),(13490,4,'RANGE'),(13491,5,'0'),(13492,6,'24'),(13493,8,'\r\n     The maximum_local_time element provides the maximum\r\n     local time of day on the target body, measured in hours\r\n     from local midnight.'),(13494,1,'APPROVED'),(13495,2,'REAL'),(13496,3,'DEG'),(13497,4,'RANGE'),(13498,5,'0'),(13499,6,'360'),(13500,8,'\r\n     The maximum_longitude element specifies the westernmost\r\n     (left_most) longitude of a spatial area, such as a map,\r\n     mosaic, bin, feature, or region.  See longitude.\r\n     Note:  The maximum longitude data element is obsolete and should no\r\n     longer be used.  The assumed coordinate system was planetographic for\r\n     prograde rotators (PDS Cartographic Standards V3.0).  See coordinate_\r\n     system_type, easternmost_longitude and westernmost_longitude.'),(13501,1,'APPROVED'),(13502,2,'REAL'),(13503,3,'NONE'),(13504,4,'RANGE'),(13505,8,'\r\n     The maximum_parameter element specifies the maximum\r\n     allowable value for a parameter input to a given data\r\n     processing program.\r\n     The parameter constrained by this value is identified by\r\n     the parameter_name element.'),(13506,1,'APPROVED'),(13507,2,'REAL'),(13508,3,'DEG'),(13509,4,'RANGE'),(13510,5,'0'),(13511,6,'180'),(13512,8,'\r\n     The maximum_phase_angle element provides the maximum phase\r\n     angle value.  See phase_angle.'),(13513,1,'APPROVED'),(13514,2,'REAL'),(13515,3,'KM'),(13516,4,'NONE'),(13517,5,'0'),(13518,8,'\r\n      The maximum_radial_resolution element indicates the\r\n     maximum (coarsest) radial distance over which changes in\r\n     ring properties can be detected within a data product.'),(13519,1,'APPROVED'),(13520,2,'REAL'),(13521,3,'KM'),(13522,4,'NONE'),(13523,5,'0'),(13524,8,'\r\n      The maximum_radial_sampling_interval element indicates the\r\n     maximum radial spacing between consecutive points in a ring\r\n     profile.  In practice, this may be somewhat smaller than\r\n     the maximum_radres element because the profile\r\n     may be over-sampled.'),(13525,1,'PENDING'),(13526,2,'REAL'),(13527,3,'KM/PIX'),(13528,4,'RANGE'),(13529,10,'3'),(13530,7,'10'),(13531,8,'\r\n     The MAXIMUM_RESOLUTION element provides the\r\n     value of the highest resolution obtained for\r\n     a given image or data product.'),(13532,1,'APPROVED'),(13533,2,'REAL'),(13534,3,'DEG'),(13535,4,'NONE'),(13536,5,'0'),(13537,6,'360'),(13538,8,'\r\n      The maximum_ring_longitude element specifies the maximum\r\n     inertial longitude of a ring area relative to the prime\r\n     meridian.  In planetary ring systems, the prime meridian is\r\n     the ascending node of the planet\'s invariable plane on the\r\n     Earth\'s mean equator of J2000.  Longitudes are measured in\r\n     the direction of orbital motion along the planet\'s\r\n     invariable plane to the ring\'s ascending node, and thence\r\n     along the ring plane.\r\n     Note:  For areas that cross the prime meridian, the maximum ring\r\n     longitude will have a value less than the minimum ring longitude.\r\n     Note:  The invariable plane of a planet is equivalent to its equatorial\r\n     plane for every ringed planet except Neptune.'),(13539,1,'APPROVED'),(13540,2,'REAL'),(13541,3,'KM'),(13542,4,'NONE'),(13543,5,'0'),(13544,8,'\r\n      The maximum_ring_radius element indicates the maximum\r\n     (outermost) radial location of an area within a planetary\r\n     ring system.  Radii are measured from the center of the\r\n     planet along the nominal ring plane.'),(13545,1,'APPROVED'),(13546,2,'REAL'),(13547,3,'NONE'),(13548,4,'RANGE'),(13549,8,'\r\n     The maximum_sampling_parameter element identifies the\r\n     maximum value at which a given data item was sampled.\r\n     For example, a spectrum that was measured in the 0.4 to 3.5\r\n     micrometer spectral region would have a\r\n     maximum_sampling_parameter value of 3.5.\r\n     The sampling parameter constrained by this value is\r\n     identified by the sampling_parameter_name element.\r\n     Note: The unit of measure for the sampling parameter is\r\n     provided by the unit element.'),(13550,1,'APPROVED'),(13551,2,'REAL'),(13552,3,'KM'),(13553,4,'RANGE'),(13554,8,'\r\n     The maximum_slant_distance element provides the maximum\r\n     slant distance value.  See slant_distance.'),(13555,1,'APPROVED'),(13556,2,'REAL'),(13557,3,'NONE'),(13558,4,'RANGE'),(13559,5,'0'),(13560,6,'1'),(13561,8,'\r\n     The maximum_solar_band_albedo element provides the maximum\r\n     solar band albedo value measured within a given set of data\r\n     or a given sequence.'),(13562,1,'APPROVED'),(13563,2,'REAL'),(13564,3,'K'),(13565,4,'RANGE'),(13566,8,'\r\n     The maximum_spectral_contrast element provides the maximum\r\n     value of spectral contrast within a given set of data.  See\r\n     spectral_contrast_range.'),(13567,1,'APPROVED'),(13568,2,'REAL'),(13569,3,'BAR'),(13570,4,'RANGE'),(13571,8,'\r\n     The maximum_surface_pressure element provides the maximum\r\n     surface pressure value for the atmosphere of a given body.'),(13572,1,'APPROVED'),(13573,2,'REAL'),(13574,3,'K'),(13575,4,'RANGE'),(13576,5,'2.4'),(13577,8,'\r\n     The maximum_surface_temperature element provides the maximum\r\n     equatorial surface temperature value for a given body during\r\n     its year.'),(13578,1,'APPROVED'),(13579,2,'REAL'),(13580,3,'MM'),(13581,4,'RANGE'),(13582,8,'\r\n     The MAXIMUM_TRAVEL_DISTANCE element gives the maximum\r\n     allowable travel distance of the MER RAT instrument along\r\n     the Z axis.'),(13583,1,'APPROVED'),(13584,2,'REAL'),(13585,3,'MICRON'),(13586,4,'RANGE'),(13587,8,'\r\n     The maximum_wavelength element identifies the maximum wavelength at which\r\n     an observation can be made or was made.  For instruments, this may depend\r\n     on the instrument detector or filter characteristics.  For data products,\r\n     this is the effective upper limit on the wavelength detected.'),(13588,1,'APPROVED'),(13589,2,'CHARACTER'),(13590,3,'NONE'),(13591,4,'DEFINITION'),(13592,7,'20'),(13593,8,'\r\n     The MCP_gain_mode_id element identifies the MCP (Micro\r\n     Channel Plate) gain state of an instrument.'),(13594,1,'PENDING'),(13595,2,'CHARACTER'),(13596,3,'NONE'),(13597,4,'DEFINITION'),(13598,10,'32'),(13599,7,'32'),(13600,8,'\r\n        The MD5 algorithm takes as input a file (message) of arbitrary length\r\n        and produces as output a 128-bit \'fingerprint\' or \'message digest\' of\r\n        the input. It is conjectured that it is computationally infeasible to\r\n        produce two messages having the same message digest, or to produce\r\n        any message having a given prespecified target message digest. The\r\n        MD5 algorithm is intended for digital signature applications.\r\n      \r\n        The MD5 algorithm is designed to be quite fast on 32-bit machines. In\r\n        addition, the MD5 algorithm does not require any large substitution\r\n        tables; the algorithm can be coded quite compactly.\r\n      \r\n        Most standard MD5 checksum calculators return a 32 character\r\n        hexadecimal value containing lower case letters. In order to\r\n        accomodate this existing standard, the PDS requires that the value\r\n        assigned to the MD5_CHECKSUM keyword be a value composed of lowercase\r\n        letters (a-f) and numbers (0-9). In order to comply with other standards\r\n        relating to the use of lowercase letters in strings, the value must be\r\n        quoted using double quotes.\r\n      \r\n      \r\n        Example:  MD5_CHECKSUM = \'0ff0a5dd0f3ea4e104b0eae98c87f36c\'\r\n      \r\n        The MD5 algorithm is an extension of the MD4 message-digest algorithm\r\n        1,2]. MD5 is slightly slower than MD4, but is more \'conservative\' in\r\n        design. MD5 was designed because it was felt that MD4 was perhaps\r\n        being adopted for use more quickly than justified by the existing\r\n        critical review; because MD4 was designed to be exceptionally fast,\r\n        it is \'at the edge\' in terms of risking successful cryptanalytic\r\n        attack. MD5 backs off a bit, giving up a little in speed for a much\r\n        greater likelihood of ultimate security. It incorporates some\r\n        suggestions made by various reviewers, and contains additional\r\n        optimizations. The MD5 algorithm has been placed in the public domain\r\n        for review and possible adoption as a standard.\r\n      \r\n        For OSI-based applications, MD5\'s object identifier is\r\n      \r\n        md5 OBJECT IDENTIFIER ::=\r\n          iso(1) member-body(2) US(840) rsadsi(113549) digestAlgorithm(2) 5}\r\n      \r\n        In the X.509 type AlgorithmIdentifier [3], the parameters for MD5\r\n        should have type NULL.\r\n      \r\n        The MD5 algorithm was described by its inventor, Ron Rivest of\r\n        RSA Data Security, Inc., in an Internet Request For Comments\r\n        document, RFC1321 (document available from the PDS).\r\n      \r\n        References\r\n        ==========\r\n        [1] Rivest, R., The MD4 Message Digest Algorithm, RFC 1320, MIT and\r\n            RSA Data Security, Inc., April 1992.\r\n      \r\n        [2] Rivest, R., The MD4 message digest algorithm, in A.J.  Menezes\r\n            and S.A. Vanstone, editors, Advances in Cryptology - CRYPTO \'90\r\n            Proceedings, pages 303-311, Springer-Verlag, 1991.\r\n      \r\n        [3] CCITT Recommendation X.509 (1988), The Directory -\r\n            Authentication Framework.'),(13601,1,'APPROVED'),(13602,2,'REAL'),(13603,3,'NONE'),(13604,4,'RANGE'),(13605,5,'0'),(13606,8,'\r\n     The mean element provides the average of the DN values in\r\n     the image array.\r\n      \r\n     Note: For the Mars Pathfinder IMP camera, this was the average of\r\n     only those pixels within the valid DN range of 0 to 4095.'),(13607,1,'APPROVED'),(13608,2,'REAL'),(13609,3,'KM'),(13610,4,'RANGE'),(13611,8,'\r\n     The mean_orbital_radius element provides the mean distance\r\n     between the center of a solar system object and the center\r\n     of its primary (e.g., the primary body for a planet is the\r\n     Sun, while the primary body for a satellite is the planet\r\n     about which it orbits).\r\n     As the radius of an elliptical orbit varies with time, the\r\n     notion of mean radius allows for general, time-independent\r\n     comparisons between the sizes of different bodies\' orbits.'),(13612,1,'APPROVED'),(13613,2,'REAL'),(13614,3,'NONE'),(13615,4,'RANGE'),(13616,8,'\r\n     The mean_radiance is the mean of the radiance values in a radiometrically\r\n     corrected product.'),(13617,1,'APPROVED'),(13618,2,'REAL'),(13619,3,'KM'),(13620,4,'RANGE'),(13621,8,'\r\n     The mean_radius element is measured or derived using a\r\n     variety of methods. It provides, approximately, an average\r\n     of the equatorial and polar radii of the best fit spheroid\r\n     (for planets) or ellipsoid (for satellites).'),(13622,1,'APPROVED'),(13623,2,'REAL'),(13624,3,'NONE'),(13625,4,'RANGE'),(13626,8,'\r\n     The MEAN_REFLECTANCE element represents the mean\r\n     reflectance of an imaged area of a target body in intensity\r\n     over flux (I over F) units.  10,000 I over F units would be\r\n     produced by normal incidence of sunlight on a Lambert disk\r\n     at the target-body\'s distance from the sun'),(13627,1,'APPROVED'),(13628,2,'REAL'),(13629,3,'D'),(13630,4,'RANGE'),(13631,8,'\r\n     The mean_solar_day element provides the average interval\r\n     required for successive transits of the Sun.  This is\r\n     computed as if planets and satellites move in circular\r\n     orbits about their primaries with periods as specified by\r\n     the revolution_period element, and as if planets and\r\n     satellites have spin axes which are perpendicular to their\r\n     orbit planes.'),(13632,1,'APPROVED'),(13633,2,'REAL'),(13634,3,'BAR'),(13635,4,'RANGE'),(13636,8,'\r\n     The mean_surface_pressure element provides the\r\n     mean equatorial atmospheric pressure value at the mean\r\n     equatorial surface of a body, averaged over the body\'s\r\n     year.'),(13637,1,'APPROVED'),(13638,2,'REAL'),(13639,3,'K'),(13640,4,'RANGE'),(13641,5,'2.4'),(13642,8,'\r\n     The mean_surface_temperature element provides the mean\r\n     equatorial surface temperature of a body, averaged over the\r\n     body\'s year.'),(13643,1,'APPROVED'),(13644,2,'REAL'),(13645,3,'B/PIXEL'),(13646,4,'RANGE'),(13647,5,'0'),(13648,6,'4'),(13649,8,'\r\n     The MEAN_TRUNCATED_BITS element provides the mean number of\r\n     truncated bits/pixel.'),(13650,1,'APPROVED'),(13651,2,'REAL'),(13652,3,'P/LINE'),(13653,4,'RANGE'),(13654,5,'0'),(13655,6,'800'),(13656,8,'\r\n     The MEAN_TRUNCATED_SAMPLES element provides the mean number\r\n     of truncated pixels/line.'),(13657,1,'APPROVED'),(13658,2,'CHARACTER'),(13659,3,'NONE'),(13660,4,'NONE'),(13661,7,'60'),(13662,8,'\r\n     The measured_quantity_name element indicates the physical\r\n     phenomenon measured by a declared unit of measure.\r\n     For example, the measured quantity name for the unit\r\n     AMPERE is ELECTRIC CURRENT.\r\n     Note: A table of standard units, unit ids, and measured\r\n     quantities based on those published by the Systeme\r\n     Internationale appears in the \'Units of Measurement\' section\r\n     of the PSDD.  (Please refer to the table of contents for its\r\n     location.)  The values in this table\'s \'Measured Quantity\'\r\n     column constitute the standard values for the data element\r\n     measured_quantity_name.'),(13663,1,'APPROVED'),(13664,2,'CHARACTER'),(13665,3,'NONE'),(13666,4,'TEXT'),(13667,8,'\r\n     The measurement_atmosphere_desc element describes\r\n     the atmospheric conditions through which data were taken.'),(13668,1,'APPROVED'),(13669,2,'CHARACTER'),(13670,3,'NONE'),(13671,4,'TEXT'),(13672,8,'\r\n     The measurement_source_desc element describes the\r\n     source of light used in a laboratory-generated data set,\r\n     or the radar transmitter in the case of radar astronomy\r\n     experiments.'),(13673,1,'APPROVED'),(13674,2,'CHARACTER'),(13675,3,'NONE'),(13676,4,'TEXT'),(13677,8,'\r\n     The measurement_standard_desc element identifies the\r\n     standard object on which observations are performed in\r\n     order to calibrate an instrument.'),(13678,1,'APPROVED'),(13679,2,'CHARACTER'),(13680,3,'NONE'),(13681,4,'TEXT'),(13682,8,'\r\n     The measurement_wave_calbrt_desc element\r\n     identifies the technique and procedure used to calibrate\r\n     wavelength.'),(13683,1,'APPROVED'),(13684,2,'REAL'),(13685,3,'NONE'),(13686,4,'RANGE'),(13687,8,'\r\n     The median element provides the median value (middle value) occurring\r\n     in a given instance of the data object.  Because of the unconventional\r\n     data type of this data element, the element should appear in labels\r\n     only within an explicit object, i.e. anywhere between an \'OBJECT =\' and\r\n     an \'END OBJECT\'.\r\n     Note: For the Mars Pathfinder IMP camera, this was the median value\r\n     of only those pixels within the valid DN range of 0 to 4095.\r\n     Note:  For Mars Pathfinder, refers specifically to the median DN value\r\n     in the image array.'),(13688,1,'APPROVED'),(13689,2,'CHARACTER'),(13690,3,'NONE'),(13691,4,'TEXT'),(13692,8,'\r\n     The medium_desc element provides the textual description for\r\n      the medium used in the distribution of an ordered data set.'),(13693,1,'APPROVED'),(13694,2,'IDENTIFIER'),(13695,3,'NONE'),(13696,4,'DYNAMIC'),(13697,7,'60'),(13698,8,'\r\n     The medium_format element identifies the unformatted\r\n     recording capacity or recording density of a given medium.'),(13699,9,'1.0_MB'),(13700,9,'1.6_MB'),(13701,9,'150_MB'),(13702,9,'1600 BPI'),(13703,9,'1_GB'),(13704,9,'2.0_MB'),(13705,9,'2_GB'),(13706,9,'30_MB'),(13707,9,'360_KB'),(13708,9,'5_GB'),(13709,9,'60_MB'),(13710,9,'6250_BPI'),(13711,9,'650_MB'),(13712,9,'800_BPI'),(13713,1,'APPROVED'),(13714,2,'CHARACTER'),(13715,3,'NONE'),(13716,4,'STATIC'),(13717,7,'30'),(13718,8,'\r\n     The medium_type element identifies the physical storage\r\n     medium for a data volume.  Examples:  CD-ROM, CARTRIDGE\r\n     TAPE.'),(13719,9,'12-IN WORM DISK'),(13720,9,'14-IN WORM DISK'),(13721,9,'19-MM HELICAL SCAN TAPE'),(13722,9,'3.5-IN MAGNETO-OPTIC DISK'),(13723,9,'3.5-IN. FLOPPY DISK'),(13724,9,'4-MM HELICAL SCAN TAPE'),(13725,9,'5.25-IN FLOPPY DISK'),(13726,9,'5.25-IN MAGNETO-OPTIC DISK'),(13727,9,'5.25-IN WORM DISK'),(13728,9,'7-TRACK MAG TAPE'),(13729,9,'8-MM HELICAL SCAN TAPE'),(13730,9,'9-TRACK MAG TAPE'),(13731,9,'CARTRIDGE TAPE'),(13732,9,'CD-ROM'),(13733,9,'CD-WO'),(13734,9,'DVD-R'),(13735,9,'DVD-ROM'),(13736,9,'ELECTRONIC'),(13737,9,'MAG TAPE'),(13738,9,'MAGNETIC TAPE'),(13739,9,'N/A'),(13740,9,'NULL'),(13741,9,'PHOTO'),(13742,9,'TAPE'),(13743,1,'APPROVED'),(13744,2,'ASCII_INTEGER'),(13745,3,'N/A'),(13746,4,'RANGE'),(13747,5,'0'),(13748,6,'4095'),(13749,10,'1'),(13750,7,'4'),(13751,8,'\r\n     The background brightness used for MDIS automatic exposure time\r\n     calculation.\r\n      \r\n     In a test image that it analyzed to determine an exposure time using\r\n     automatic exposure, DPU hardware generates a histogram of the image.\r\n     The histogram is analyzed by the software to determine if the image is\r\n     overexposed or underexposed, and the exposure time is adjusted accordingly\r\n     by analyzing the histogram of raw DN values in different brightness bins.\r\n     The background or dark current level (MESS:AEX_BACB) is taken into account\r\n     and is assumed to be a constant value.\r\n      \r\n     A threshold of number of pixels (MESS:AEX_STHR) is allowed to exceed a\r\n     target brightness  (MESS:AEX_TGTB).  Starting with the maximum value,\r\n     the number of pixels exceeding the target is counted, and the\r\n     brightness of the histogram bin in which that threshold is reached\r\n     (MESS:AEX_STAT) is reported.  The exposure time is scaled back by the\r\n     ratio of MESS:AEX_TGTB/MESS:AEX_STAT.'),(13752,1,'APPROVED'),(13753,2,'ASCII_INTEGER'),(13754,3,'MS'),(13755,4,'RANGE'),(13756,5,'0'),(13757,6,'989'),(13758,10,'1'),(13759,7,'3'),(13760,8,'\r\n     The maximum allowable exposure time from an MDIS automatic exposure time\r\n     calculation.\r\n      \r\n     In a test image that it analyzed to determine an exposure time using\r\n     automatic exposure, DPU hardware generates a histogram of the image.\r\n     The histogram is analyzed by the software to determine if the image is\r\n     overexposed or underexposed, and the exposure time is adjusted accordingly\r\n     by analyzing the histogram of raw DN values in different brightness bins.\r\n     The background or dark current level (MESS:AEX_BACB) is taken into account\r\n     and is assumed to be a constant value.\r\n      \r\n     A threshold of number of pixels (MESS:AEX_STHR) is allowed to exceed a\r\n     target brightness  (MESS:AEX_TGTB).  Starting with the maximum value,\r\n     the number of pixels exceeding the target is counted, and the\r\n     brightness of the histogram bin in which that threshold is reached\r\n     (MESS:AEX_STAT) is reported.  The exposure time is scaled back by the\r\n     ratio of MESS:AEX_TGTB/MESS:AEX_STAT.'),(13761,1,'APPROVED'),(13762,2,'ASCII_INTEGER'),(13763,3,'MS'),(13764,4,'RANGE'),(13765,5,'0'),(13766,6,'989'),(13767,10,'1'),(13768,7,'3'),(13769,8,'\r\n     The minimum allowable exposure time from an MDIS automatic exposure time\r\n     calculation.\r\n      \r\n     In a test image that it analyzed to determine an exposure time using\r\n     automatic exposure, DPU hardware generates a histogram of the image.\r\n     The histogram is analyzed by the software to determine if the image is\r\n     overexposed or underexposed, and the exposure time is adjusted accordingly\r\n     by analyzing the histogram of raw DN values in different brightness bins.\r\n     The background or dark current level (MESS:AEX_BACB) is taken into account\r\n     and is assumed to be a constant value.\r\n      \r\n     A threshold of number of pixels (MESS:AEX_STHR) is allowed to exceed a\r\n     target brightness  (MESS:AEX_TGTB).  Starting with the maximum value,\r\n     the number of pixels exceeding the target is counted, and the\r\n     brightness of the histogram bin in which that threshold is reached\r\n     (MESS:AEX_STAT) is reported.  The exposure time is scaled back by the\r\n     ratio of MESS:AEX_TGTB/MESS:AEX_STAT.'),(13770,1,'APPROVED'),(13771,2,'ASCII_INTEGER'),(13772,3,'N/A'),(13773,4,'RANGE'),(13774,5,'0'),(13775,6,'4095'),(13776,10,'1'),(13777,7,'4'),(13778,8,'\r\n     The bin in a DPU histogram of image brightness used for MDIS automatic\r\n     exposure time calculation.\r\n      \r\n     In a test image that it analyzed to determine an exposure time using\r\n     automatic exposure, DPU hardware generates a histogram of the image.\r\n     The histogram is analyzed by the software to determine if the image is\r\n     overexposed or underexposed, and the exposure time is adjusted accordingly\r\n     by analyzing the histogram of raw DN values in different brightness bins.\r\n     The background or dark current level (MESS:AEX_BACB) is taken into account\r\n     and is assumed to be a constant value.\r\n      \r\n     A threshold of number of pixels (MESS:AEX_STHR) is allowed to exceed a\r\n     target brightness  (MESS:AEX_TGTB).  Starting with the maximum value,\r\n     the number of pixels exceeding the target is counted, and the\r\n     brightness of the histogram bin in which that threshold is reached\r\n     (MESS:AEX_STAT) is reported.  The exposure time is scaled back by the\r\n     ratio of MESS:AEX_TGTB/MESS:AEX_STAT.'),(13779,1,'APPROVED'),(13780,2,'ASCII_INTEGER'),(13781,3,'N/A'),(13782,4,'RANGE'),(13783,5,'0'),(13784,6,'65535'),(13785,10,'1'),(13786,7,'5'),(13787,8,'\r\n     The number of pixels allowed to exceed target brightness during an MDIS\r\n     automatic exposure time calculation.\r\n      \r\n     In a test image that it analyzed to determine an exposure time using\r\n     automatic exposure, DPU hardware generates a histogram of the image.\r\n     The histogram is analyzed by the software to determine if the image is\r\n     overexposed or underexposed, and the exposure time is adjusted accordingly\r\n     by analyzing the histogram of raw DN values in different brightness bins.\r\n     The background or dark current level (MESS:AEX_BACB) is taken into account\r\n     and is assumed to be a constant value.\r\n      \r\n     A threshold of number of pixels (MESS:AEX_STHR) is allowed to exceed a\r\n     target brightness  (MESS:AEX_TGTB).  Starting with the maximum value,\r\n     the number of pixels exceeding the target is counted, and the\r\n     brightness of the histogram bin in which that threshold is reached\r\n     (MESS:AEX_STAT) is reported.  The exposure time is scaled back by the\r\n     ratio of MESS:AEX_TGTB/MESS:AEX_STAT.'),(13788,1,'APPROVED'),(13789,2,'ASCII_INTEGER'),(13790,3,'N/A'),(13791,4,'RANGE'),(13792,5,'0'),(13793,6,'4095'),(13794,10,'1'),(13795,7,'4'),(13796,8,'\r\n     The target brightness used for MDIS automatic exposure time calculation.\r\n      \r\n     In a test image that it analyzed to determine an exposure time using\r\n     automatic exposure, DPU hardware generates a histogram of the image.\r\n     The histogram is analyzed by the software to determine if the image is\r\n     overexposed or underexposed, and the exposure time is adjusted accordingly\r\n     by analyzing the histogram of raw DN values in different brightness bins.\r\n     The background or dark current level (MESS:AEX_BACB) is taken into account\r\n     and is assumed to be a constant value.\r\n      \r\n     A threshold of number of pixels (MESS:AEX_STHR) is allowed to exceed a\r\n     target brightness  (MESS:AEX_TGTB).  Starting with the maximum value,\r\n     the number of pixels exceeding the target is counted, and the\r\n     brightness of the histogram bin in which that threshold is reached\r\n     (MESS:AEX_STAT) is reported.  The exposure time is scaled back by the\r\n     ratio of MESS:AEX_TGTB/MESS:AEX_STAT.'),(13797,1,'APPROVED'),(13798,2,'INTEGER'),(13799,3,'S'),(13800,4,'DEFINITION'),(13801,5,'0'),(13802,10,'1'),(13803,7,'10'),(13804,8,'\r\n     The mission-elapsed-time, or MET, in seconds since MESSENGER launch, of\r\n     the second during which the spacecraft attitude measurement in the header\r\n     of an MDIS image was acquired.'),(13805,1,'APPROVED'),(13806,2,'ASCII_INTEGER'),(13807,3,'N/A'),(13808,4,'DEFINITION'),(13809,5,'0'),(13810,6,'7'),(13811,10,'1'),(13812,7,'1'),(13813,8,'\r\n     Attitude quality flag for the spacecraft attitude quaternion in the\r\n     header of an MDIS image:\r\n      \r\n     7 = Attitude Knowledge OK (At least 1 Star Tracker is available and at\r\n         least 50% of gyro data is valid)\r\n      \r\n     6 = Attitude Knowledge OK (No Star Tracker is available but at least\r\n         50% of gyro data is valid)\r\n      \r\n     5 = Attitude Knowledge OK (No Star Tracker is and between 10% and 50%\r\n         of gyro data is valid -OR- At least 1 Star Tracker is valid and\r\n         between 0% and 50% of gyro data valid)\r\n      \r\n     4 = not a legal option\r\n      \r\n     3 = Attitude Knowledge BAD (At least 1 Star Tracker is available and\r\n         at least 50% of gyro data is valid)\r\n      \r\n     2 = Attitude Knowledge BAD (No Star Tracker is available but at least\r\n         50% of gyro data is valid)\r\n      \r\n     1 = Attitude Knowledge BAD (No Star Tracker is available and between 10%\r\n         and 50% of gyro data is valid -OR- At least 1 Star Tracker is valid\r\n         and between 0% and 50% of gryo data is valid)\r\n      \r\n     0 = Attitude Knowledge BAD (No Star Tracker data fewer than 10% of gyro\r\n         data valid).'),(13814,9,'0'),(13815,9,'1'),(13816,9,'2'),(13817,9,'3'),(13818,9,'5'),(13819,9,'6'),(13820,9,'7'),(13821,1,'APPROVED'),(13822,2,'REAL'),(13823,3,'RAD'),(13824,4,'RANGE'),(13825,5,'-1'),(13826,6,'1'),(13827,10,'1'),(13828,7,'12'),(13829,8,'\r\n     The roll value of the vector component of the attitude quaternion\r\n     representing spacecraft attitude, in the header of an MDIS image.'),(13830,1,'APPROVED'),(13831,2,'REAL'),(13832,3,'RAD'),(13833,4,'RANGE'),(13834,5,'-1'),(13835,6,'1'),(13836,10,'1'),(13837,7,'12'),(13838,8,'\r\n     The pitch value of the vector component of the attitude quaternion\r\n     representing spacecraft attitude, in the header of an MDIS image.'),(13839,1,'APPROVED'),(13840,2,'REAL'),(13841,3,'RAD'),(13842,4,'RANGE'),(13843,5,'-1'),(13844,6,'1'),(13845,10,'1'),(13846,7,'12'),(13847,8,'\r\n     The yaw value of the vector component of the attitude quaternion\r\n     representing spacecraft attitude, in the header of an MDIS image.'),(13848,1,'APPROVED'),(13849,2,'REAL'),(13850,3,'RAD'),(13851,4,'RANGE'),(13852,5,'-1'),(13853,6,'1'),(13854,10,'1'),(13855,7,'12'),(13856,8,'\r\n     The scalar component of the attitude quaternion representing\r\n     spacecraft attitude, in the header of an MDIS image.'),(13857,1,'APPROVED'),(13858,2,'ASCII_INTEGER'),(13859,3,'N/A'),(13860,4,'RANGE'),(13861,5,'0'),(13862,6,'1023'),(13863,10,'1'),(13864,7,'4'),(13865,8,'\r\n     The temperature of the focal plane array in raw counts at observation\r\n     time.  The conversion formula to degrees Celsius depends on the camera\r\n     performing the observation:\r\n      \r\n     For WAC: Temperature = -263.2584 + Raw * 0.5022\r\n      \r\n     For NAC: Temperature = -268.8441 + Raw * 0.5130\r\n      \r\n     Where Raw is the raw counts in telemetry (MESS:CAM_T1).'),(13866,1,'APPROVED'),(13867,2,'ASCII_INTEGER'),(13868,3,'N/A'),(13869,4,'RANGE'),(13870,5,'0'),(13871,6,'1023'),(13872,10,'1'),(13873,7,'4'),(13874,8,'\r\n     Camera temperature 2 in raw counts.  The meaning depends on whether it is\r\n     being reported by the WAC or NAC. A single telemetry point is used to\r\n     return the raw value of filter wheel temperature (WAC), FILTER_TEMPERATURE\r\n     once converted to units of degrees Celsius, or the raw value of telescope\r\n     temperature (NAC), OPTICS_TEMPERATURE once converted to units of degrees\r\n     Celsius, depending on which camera is in use.\r\n      \r\n     For the WAC, this is temperature of the filter wheel. Thus,\r\n     FILTER_TEMPERATURE is \'N/A\' if the NAC was used for the observation because\r\n     the telemetry point will be a measurement of the NAC telescope temperature.\r\n     For the WAC the conversion from raw counts to degrees Celsius is:\r\n      \r\n     T = -292.7603 + Raw * 0.5553\r\n      \r\n     where Raw is the raw counts in MESS:CAM_T2.\r\n      \r\n     For the NAC, this is temperature of the NAC telescope. Thus\r\n     OPTICS_TEMPERATURE is \'N/A\' if the WAC was used for observation because the\r\n     telemetry point will be a measurement of the WAC filter wheel temperature.\r\n     For the NAC the conversion from raw counts to degrees Celsius is:\r\n      \r\n     T = -269.7180 + Raw * 0.4861\r\n      \r\n     where Raw is the raw counts in telemetry (MESS:CAM_T2).'),(13875,1,'APPROVED'),(13876,2,'ASCII_INTEGER'),(13877,3,'N/A'),(13878,4,'RANGE'),(13879,5,'0'),(13880,6,'4095'),(13881,10,'1'),(13882,7,'4'),(13883,8,'\r\n     MDIS CCD temperature in raw counts. The conversion formula to degrees\r\n     Celsius depends on the camera performing the observation:\r\n      \r\n     For WAC: Temperature = -318.4553 + Raw * 0.2718\r\n      \r\n     For NAC: Temperature = -323.3669 + Raw * 0.2737\r\n      \r\n     Where Raw is the raw counts in telemetry\r\n     (MESS:CCD_TEMP).'),(13884,1,'APPROVED'),(13885,2,'ASCII_INTEGER'),(13886,3,'N/A'),(13887,4,'RANGE'),(13888,5,'0'),(13889,6,'1'),(13890,10,'1'),(13891,7,'1'),(13892,8,'\r\n     12 to 8 bit image compression enabled or disabled. Which algorithm is\r\n     used is specified by MESS:\r\n       0 = disabled (images are 12-bit)\r\n       1 = enabled (images are 8-bit).'),(13893,1,'APPROVED'),(13894,2,'ASCII_INTEGER'),(13895,3,'N/A'),(13896,4,'DEFINITION'),(13897,5,'0'),(13898,6,'7'),(13899,10,'1'),(13900,7,'1'),(13901,8,'\r\n     12 to 8 bit compression algorithm (0-7) used to compress images from\r\n     12 to 8 bits. Whether this option is enabled is indicated by MESS:COMP12_8.\r\n     The compression is implemented using one of eight lookup tables, which are\r\n     optimized to the lower WAC CCD read noise and higher NAC read noise, light\r\n     levels, and bias level (nominal or after inflight drift):\r\n      \r\n     0 = Lo-noise hi-bias SNR proportional.  Case: Either NAC or WAC, for\r\n     nominal bias (all DNs greater than 12-bit 230).  Formulation: Maps\r\n     12-bit DNs between bias and saturation into 8 bits, proportional to SNR.\r\n     Information loss is spread evenly over dynamic range.  Usage: Typical\r\n     imaging with varied brightness.\r\n      \r\n     1 = Lo-noise hi-bias DN-weighted SNR proportional. Case: Low-noise (WAC)\r\n     CCD, bias nominal (all DNs greater than 12-bit 230). Formulation: Maps 12\r\n     bits between bias and saturation into 8 bits proportional to sliding scale.\r\n     Information is preferentially retained at the low DN end. Usage: Faint\r\n     objects. Saturates at a DN of 3000.\r\n      \r\n     2 = Hi-noise hi-bias DN-weighted SNR proportional. Case: High-noise (NAC)\r\n     CCD, bias nominal (all DNs greater than 12-bit 230). Formulation: Maps 12\r\n     bits between bias and saturation into 8 bits proportional to sliding\r\n     scale.  Information is preferentially retained at the low DN end.\r\n     Usage: B/W, mostly low brightness.\r\n      \r\n     3 = Lo-noise med-bias SNR proportional. Case: Either CCD, assuming bias\r\n     has dropped tens DN (all DNs greater than 12-bit 180).  Formulation:\r\n     Maps 12-bit DNs between bias and saturation into 8 bits, proportional to\r\n     SNR. Information loss is spread over dynamic range. Usage:\r\n     Typical imaging, varied brightness.\r\n      \r\n     4 = Lo-noise med-bias DN-weighted SNR proportional. Case: Lo-noise (WAC)\r\n     CCD, assuming bias has dropped tens DN (all DNs greater than 12-bit 180).\r\n     Formulation: Maps 12 bits between bias and saturation into 8 bits\r\n     proportional to sliding scale. Information retained at low DN end.\r\n     Usage: Faint objects.  Saturates at a DN of 3000.\r\n      \r\n     5 = Hi-noise med-bias DN-weighted SNR proportional. Case: High-noise (NAC)\r\n     CCD, assuming bias has dropped tens DN (all DNs greater than 12-bit 180).\r\n     Formulation: Maps 12 bits between bias and saturation into 8 bits\r\n     proportional to sliding scale. Information is retained preferentially at\r\n     the low end of the DN range. Usage: B/W, mostly low brightness.\r\n      \r\n     6 = Zero-bias SNR proportional. Case: Contingency; assuming bias\r\n     decreased to near 0 from the nominal 230 12-bit DNs.\r\n     Formulation: Maps 12-bit DNs between bias and saturation into 8 bits,\r\n     proportional to SNR. Information loss is spread over the dynamic range.\r\n     Usage: Typical imaging, varied brightness.\r\n      \r\n     7 = Linear. Case: either CCD, bias or read noise. Formulation: Maps 12-bit\r\n     DNs between the bias level and saturation linearly into 8-bit space.\r\n     Usage: High brightness mapping; information loss greatest at low DNs,\r\n     preserves information at high DNs.'),(13902,1,'APPROVED'),(13903,2,'ASCII_INTEGER'),(13904,3,'N/A'),(13905,4,'DEFINITION'),(13906,5,'0'),(13907,6,'1'),(13908,10,'1'),(13909,7,'1'),(13910,8,'\r\n     Status of lossless Fast compression of MDIS images. This is applied to\r\n     images by the instrument itself. The images are first uncompressed on\r\n     the solid-state recorder if lossy wavelet compression is applied:\r\n       0 = Fast disabled\r\n       1 = Fast enabled.'),(13911,1,'APPROVED'),(13912,2,'ASCII_INTEGER'),(13913,3,'N/A'),(13914,4,'DEFINITION'),(13915,5,'0'),(13916,6,'1'),(13917,10,'1'),(13918,7,'1'),(13919,8,'\r\n     When true, this indicates that the MDIS image is a critical optical\r\n     navigation image and will be compressed by the MESSENGER Main\r\n     Processor (MP) before other images. Normally, the MP compresses images\r\n     in the order that they are received.\r\n       0 = False\r\n       1 = True.'),(13920,1,'APPROVED'),(13921,2,'ASCII_INTEGER'),(13922,3,'N/A'),(13923,4,'DEFINITION'),(13924,5,'0'),(13925,6,'9'),(13926,10,'1'),(13927,7,'1'),(13928,8,'\r\n     Priority for downlink of an MDIS image file from the MESSENGER spacecraft:\r\n       0 : Priority #0 (highest)\r\n       1 : Priority #1\r\n       .\r\n       .\r\n       9 : Priority #9 (lowest).'),(13929,1,'APPROVED'),(13930,2,'ASCII_INTEGER'),(13931,3,'N/A'),(13932,4,'DEFINITION'),(13933,5,'0'),(13934,6,'1'),(13935,10,'1'),(13936,7,'1'),(13937,8,'\r\n     The identified of the DPU used during acquisition of an MDIS image:\r\n      0 = DPU-A\r\n      1 = DPU-B.'),(13938,1,'APPROVED'),(13939,2,'ASCII_INTEGER'),(13940,3,'N/A'),(13941,4,'DEFINITION'),(13942,5,'0'),(13943,6,'1'),(13944,10,'1'),(13945,7,'1'),(13946,8,'\r\n     Exposure time mode used for acquisition of an MDIS image. Manual\r\n     exposure uses a pre-commanded exposure time. Autoexposure determines the\r\n     exposure time from test images taken before the exposure, targeting a\r\n     specific brightness value.\r\n       0 = Manual\r\n       1 = Automatic.'),(13947,1,'APPROVED'),(13948,2,'ASCII_INTEGER'),(13949,3,'MS'),(13950,4,'RANGE'),(13951,5,'0'),(13952,6,'9990'),(13953,10,'1'),(13954,7,'4'),(13955,8,'\r\n     MDIS exposure time in milliseconds.'),(13956,1,'APPROVED'),(13957,2,'ASCII_INTEGER'),(13958,3,'N/A'),(13959,4,'DEFINITION'),(13960,5,'0'),(13961,6,'1'),(13962,10,'1'),(13963,7,'1'),(13964,8,'\r\n     On-chip image binning option for MDIS.  Images may be taken either without\r\n     on-chip binning or with 2x2 binning, which decreases the size of a full\r\n     image from 1024x1024 pixels to 512x512 pixels. On-chip binning can\r\n     be used to manage the size of raw images being stored on the spacecraft\r\n     solid-state recorder, or to increase CCD sensitivity. If this option is\r\n     used, sensitivity increases by about a factor of four but read noise is\r\n     similar:\r\n       0 = 1x1 binning (none)\r\n       1 = 2x2 binning.'),(13965,1,'APPROVED'),(13966,2,'ASCII_INTEGER'),(13967,3,'N/A'),(13968,4,'RANGE'),(13969,5,'0'),(13970,6,'65535'),(13971,10,'1'),(13972,7,'5'),(13973,8,'\r\n     The goal position, in raw counts of the position resolver on the MDIS\r\n     filter wheel. For each commanded filter number, the instrument software\r\n     will try to place the filter wheel at the following positions:\r\n      \r\n     FILTER_NUMBER MESS:FW_GOAL\r\n     1             17376\r\n     2             11976\r\n     3              6492\r\n     4              1108\r\n     5             61104\r\n     6             55684\r\n     7             50148\r\n     8             44760\r\n     9             39256\r\n     10            33796\r\n     11            28252\r\n     12            22852\r\n      \r\n     Actual position attained is reported in MESS:FW_POS.'),(13974,1,'APPROVED'),(13975,2,'ASCII_INTEGER'),(13976,3,'N/A'),(13977,4,'RANGE'),(13978,5,'0'),(13979,6,'65535'),(13980,10,'1'),(13981,7,'5'),(13982,8,'\r\n     The actual position, in raw counts of the position resolver on the MDIS\r\n     filter wheel. For each commanded filter number, the instrument software\r\n     will try to place the filter wheel at the following positions:\r\n      \r\n     FILTER_NUMBER MESS:FW_GOAL\r\n     1             17376\r\n     2             11976\r\n     3              6492\r\n     4              1108\r\n     5             61104\r\n     6             55684\r\n     7             50148\r\n     8             44760\r\n     9             39256\r\n     10            33796\r\n     11            28252\r\n     12            22852\r\n      \r\n     Commanded position is reported in MESS:FW_GOAL. There is a tolerance\r\n     of 240 resolver counts around MESS:FW_GOAL for MESS:FW_POS to\r\n     indicate that the filter wheel is correctly positioned.'),(13983,1,'APPROVED'),(13984,2,'ASCII_INTEGER'),(13985,3,'N/A'),(13986,4,'DEFINITION'),(13987,5,'0'),(13988,6,'1'),(13989,10,'1'),(13990,7,'1'),(13991,8,'\r\n     Validity flag for position of the MDIS filter wheel given in MESS:FW_POS.\r\n       0 = invalid\r\n       1 = valid.'),(13992,1,'APPROVED'),(13993,2,'ASCII_INTEGER'),(13994,3,'N/A'),(13995,4,'RANGE'),(13996,5,'0'),(13997,6,'65535'),(13998,10,'1'),(13999,7,'5'),(14000,8,'\r\n     The raw value from the MDIS filter wheel resolver in resolver counts.\r\n     It is used by the flight software to compute MESS:FW_POS. For each\r\n     commanded filter number, the instrument software will try to place\r\n     the filter wheel at the following positions:\r\n      \r\n     FILTER_NUMBER MESS:FW_GOAL\r\n     1             17376\r\n     2             11976\r\n     3              6492\r\n     4              1108\r\n     5             61104\r\n     6             55684\r\n     7             50148\r\n     8             44760\r\n     9             39256\r\n     10            33796\r\n     11            28252\r\n     12            22852\r\n      \r\n     Commanded position is reported in MESS:FW_GOAL. There is a tolerance\r\n     of 240 resolver counts around MESS:FW_GOAL for MESS:FW_POS to\r\n     indicate that the filter wheel is correctly positioned.'),(14001,1,'APPROVED'),(14002,2,'ASCII_INTEGER'),(14003,3,'N/A'),(14004,4,'DEFINITION'),(14005,5,'0'),(14006,6,'1'),(14007,10,'1'),(14008,7,'1'),(14009,8,'\r\n     Validity flag for reading of the MDIS filter wheel given in MESS:FW_READ.\r\n       0 = invalid\r\n       1 = valid.'),(14010,1,'APPROVED'),(14011,2,'ASCII_INTEGER'),(14012,3,'N/A'),(14013,4,'DEFINITION'),(14014,5,'0'),(14015,6,'1'),(14016,10,'1'),(14017,7,'1'),(14018,8,'\r\n     Which of the two cameras was used during acquisition of an MDIS image:\r\n      0 = WAC\r\n      1 = NAC.'),(14019,1,'APPROVED'),(14020,2,'ASCII_INTEGER'),(14021,3,'N/A'),(14022,4,'DEFINITION'),(14023,5,'0'),(14024,6,'1'),(14025,10,'1'),(14026,7,'1'),(14027,8,'\r\n     When true, this indicates that an MDIS image is subsampled by jailbars,\r\n     a subset of all the image columns that are downlinked to save data\r\n     volume in optical navigation images. The start column, stop column,\r\n     and column spacing are indicated by MESS:JB_X0, MESS:JB_X1, and\r\n     MESS:JB_SPACE respectively.  Jailbars are defined in the original\r\n     1024x1024 pixel MDIS coordinate system before pixel binning as\r\n     described by MESS:FPU_BIN and MESS:PIXELBIN.\r\n       0 = False\r\n       1 = True.'),(14028,1,'APPROVED'),(14029,2,'ASCII_INTEGER'),(14030,3,'N/A'),(14031,4,'RANGE'),(14032,5,'0'),(14033,6,'1023'),(14034,10,'1'),(14035,7,'4'),(14036,8,'\r\n     The column spacing for jailbars in an MDIS image, a subset of all\r\n     the image columns that are downlinked to save data volume in optical\r\n     navigation images.  Jailbars are defined in the original 1024x1024\r\n     pixel MDIS coordinate system before pixel binning as described by\r\n     MESS:FPU_BIN and MESS:PIXELBIN.'),(14037,1,'APPROVED'),(14038,2,'ASCII_INTEGER'),(14039,3,'N/A'),(14040,4,'RANGE'),(14041,5,'0'),(14042,6,'1023'),(14043,10,'1'),(14044,7,'4'),(14045,8,'\r\n     The start column for jailbars in an MDIS image, a subset of all\r\n     the image columns that are downlinked to save data volume in optical\r\n     navigation images.  Jailbars are defined in the original 1024x1024\r\n     pixel MDIS coordinate system before pixel binning as described by\r\n     MESS:FPU_BIN and MESS:PIXELBIN.'),(14046,1,'APPROVED'),(14047,2,'ASCII_INTEGER'),(14048,3,'N/A'),(14049,4,'RANGE'),(14050,5,'0'),(14051,6,'1023'),(14052,10,'1'),(14053,7,'4'),(14054,8,'\r\n     The stop column for jailbars in an MDIS image, a subset of all the\r\n     image columns that are downlinked to save data volume in optical\r\n     navigation images.  Jailbars are defined in the original 1024x1024\r\n     pixel MDIS coordinate system before pixel binning as described by\r\n     MESS:FPU_BIN and MESS:PIXELBIN.'),(14055,1,'APPROVED'),(14056,2,'ASCII_INTEGER'),(14057,3,'N/A'),(14058,4,'DEFINITION'),(14059,5,'0'),(14060,6,'1'),(14061,10,'1'),(14062,7,'1'),(14063,8,'\r\n     Indicator if MDIS FPU (focal plane unit) is latched up. If the value\r\n     is 1 then the image data are probably invalid.\r\n       0 = OK\r\n       1 = Latched.'),(14064,1,'APPROVED'),(14065,2,'INTEGER'),(14066,3,'S'),(14067,4,'DEFINITION'),(14068,5,'0'),(14069,10,'1'),(14070,7,'10'),(14071,8,'\r\n     The mission-elapsed-time, or MET, in seconds since MESSENGER launch of\r\n     the second during which an MDIS image completes its exposure.'),(14072,1,'APPROVED'),(14073,2,'ASCII_INTEGER'),(14074,3,'N/A'),(14075,4,'RANGE'),(14076,5,'-32768'),(14077,6,'32768'),(14078,10,'1'),(14079,7,'6'),(14080,8,'\r\n     The offset in measured pivot position applied to MESS:PIV_POS and\r\n     MESS:PIV_GOAL so that zero is as close as possible to true spacecraft nadir\r\n     (+z axis). The correction is in increments of (180 DEGREES / (2**15)).'),(14081,1,'APPROVED'),(14082,2,'ASCII_INTEGER'),(14083,3,'N/A'),(14084,4,'RANGE'),(14085,5,'-32768'),(14086,6,'32768'),(14087,10,'1'),(14088,7,'6'),(14089,8,'\r\n     The commanded position of the MDIS pivot during exposure of an MDIS image,\r\n     in increments of (180 DEGREES / (2**15)) with zero at nadir. -180 degrees\r\n     is stowed.'),(14090,1,'APPROVED'),(14091,2,'ASCII_INTEGER'),(14092,3,'N/A'),(14093,4,'DEFINITION'),(14094,5,'0'),(14095,6,'1'),(14096,10,'1'),(14097,7,'1'),(14098,8,'\r\n     Status of main processor (MP) control of the MDIS pivot. If this is\r\n     enabled, then the pivot goes to a position broadcast by the MP that\r\n     points MDIS to nadir or some other aimpoint. If not enabled then a\r\n     discrete pivot position is commanded.\r\n       0 = Disabled\r\n       1 = Enabled.'),(14099,1,'APPROVED'),(14100,2,'ASCII_INTEGER'),(14101,3,'N/A'),(14102,4,'RANGE'),(14103,5,'-32768'),(14104,6,'32768'),(14105,10,'1'),(14106,7,'6'),(14107,8,'\r\n     The actual position of the MDIS pivot during exposure of an MDIS image,\r\n     in increments of (180 DEGREES / (2**15)) with zero at nadir. -180 degrees\r\n     is stowed.'),(14108,1,'APPROVED'),(14109,2,'ASCII_INTEGER'),(14110,3,'N/A'),(14111,4,'DEFINITION'),(14112,5,'0'),(14113,6,'1'),(14114,10,'1'),(14115,7,'1'),(14116,8,'\r\n     Validity flag for position of the MDIS pivot given in MESS:PIV_POS.\r\n       0 = invalid\r\n       1 = valid.'),(14117,1,'APPROVED'),(14118,2,'ASCII_INTEGER'),(14119,3,'N/A'),(14120,4,'RANGE'),(14121,5,'0'),(14122,6,'65535'),(14123,10,'1'),(14124,7,'5'),(14125,8,'\r\n     Raw pivot reading from resolver (in units of resolver counts). The pivot\r\n     platform resolver only covers 45 degrees of motion; the resolver read-out\r\n     values repeat eight times over the entire 360 degrees that an\r\n     unconstrained platform could travel.  This value is used along with\r\n     dead-reckoning knowledge of which octant the platform is in to give\r\n     the value in MESS:PIV_POS.'),(14126,1,'APPROVED'),(14127,2,'ASCII_INTEGER'),(14128,3,'N/A'),(14129,4,'DEFINITION'),(14130,5,'0'),(14131,6,'1'),(14132,10,'1'),(14133,7,'1'),(14134,8,'\r\n     Validity flag for reading of the MDIS pivot given in MESS:PIV_READ.\r\n       0 = invalid\r\n       1 = valid.'),(14135,1,'APPROVED'),(14136,2,'ASCII_INTEGER'),(14137,3,'N/A'),(14138,4,'DEFINITION'),(14139,5,'0'),(14140,6,'3'),(14141,10,'1'),(14142,7,'1'),(14143,8,'\r\n     Pivot control state of MDIS.\r\n      \r\n     A resolver provides a position reading of the pivot platform. The\r\n     resolver only covers 45 degrees of motion; the resolver read-out values\r\n     repeat eight times over the entire 360 degrees that an unconstrained\r\n     platform could travel.  The DPU software must determine in which of the\r\n     eight octants the platform is located before the resolver reading is\r\n     meaningful.  The software combines the octant with the resolver reading\r\n     to form a position that covers the entire 360 degrees.\r\n      \r\n     To determine the octant the DPU software must be commanded to \'home\'\r\n     the platform.  To home the pivot platform, the software drives the\r\n     motor open loop backwards into the hard stop at -185 degrees.  Then\r\n     the software drives the motor forward, open loop, prepositioning it to\r\n     -179 degrees.  Until homing is completed, the pivot platform is\r\n     considered \'lost\' and all other pivot commands will remain pending.\r\n      \r\n     This status item describes that state of the pivot in determining this\r\n     position knowledge.\r\n      \r\n       0 = Lost\r\n       1 = Searching\r\n       2 = Found\r\n       3 = OK.'),(14144,1,'APPROVED'),(14145,2,'ASCII_INTEGER'),(14146,3,'N/A'),(14147,4,'DEFINITION'),(14148,5,'0'),(14149,6,'8'),(14150,10,'1'),(14151,7,'1'),(14152,8,'\r\n     Pixel binning done to MDIS images by the MESSENGER spacecraft main\r\n     processor (MP). This is in addition to on-chip binning as described\r\n     by MESS:FPU_BIN.\r\n       0 - no further binning\r\n       2 - 2x2 binning\r\n       4 - 4x4 binning\r\n       8 - 8x8 binning.'),(14153,1,'APPROVED'),(14154,2,'ASCII_INTEGER'),(14155,3,'N/A'),(14156,4,'DEFINITION'),(14157,5,'0'),(14158,6,'2'),(14159,10,'1'),(14160,7,'1'),(14161,8,'\r\n     Source of an MDIS image, either a scene image from the CCD or one\r\n     of two test patterns:\r\n       0 = CCD\r\n       1 = Test pattern\r\n       2 = Inverted test pattern.'),(14162,1,'APPROVED'),(14163,2,'ASCII_INTEGER'),(14164,3,'N/A'),(14165,4,'RANGE'),(14166,5,'0'),(14167,6,'1024'),(14168,10,'1'),(14169,7,'4'),(14170,8,'\r\n     The number of columns in the FIRST rectangular subframe within an MDIS\r\n     image to be retained after image compression by the MESSENGER spacecraft\r\n     main processor (MP). There may be up to five subframes per image as\r\n     defined by MESS:SUBFRAME. Subframes are defined in the original\r\n     1024x1024 pixel MDIS coordinate system before pixel binning as described\r\n     by MESS:FPU_BIN and MESS:PIXELBIN.'),(14171,1,'APPROVED'),(14172,2,'ASCII_INTEGER'),(14173,3,'N/A'),(14174,4,'RANGE'),(14175,5,'0'),(14176,6,'1024'),(14177,10,'1'),(14178,7,'4'),(14179,8,'\r\n     The number of columns in the SECOND rectangular subframe within an MDIS\r\n     image to be retained after image compression by the MESSENGER spacecraft\r\n     main processor (MP). There may be up to five subframes per image as\r\n     defined by MESS:SUBFRAME. Subframes are defined in the original 1024x1024\r\n     pixel MDIS coordinate system before pixel binning as described by\r\n     MESS:FPU_BIN and MESS:PIXELBIN.'),(14180,1,'APPROVED'),(14181,2,'ASCII_INTEGER'),(14182,3,'N/A'),(14183,4,'RANGE'),(14184,5,'0'),(14185,6,'1024'),(14186,10,'1'),(14187,7,'4'),(14188,8,'\r\n     The number of columns in the THIRD rectangular subframe within an MDIS\r\n     image to be retained after image compression by the MESSENGER spacecraft\r\n     main processor (MP). There may be up to five subframes per image as\r\n     defined by MESS:SUBFRAME. Subframes are defined in the original\r\n     1024x1024 pixel MDIS coordinate system before pixel binning as described\r\n     by MESS:FPU_BIN and MESS:PIXELBIN.'),(14189,1,'APPROVED'),(14190,2,'ASCII_INTEGER'),(14191,3,'N/A'),(14192,4,'RANGE'),(14193,5,'0'),(14194,6,'1024'),(14195,10,'1'),(14196,7,'4'),(14197,8,'\r\n     The number of columns in the FOURTH rectangular subframe within an MDIS\r\n     image to be retained after image compression by the MESSENGER spacecraft\r\n     main processor (MP). There may be up to five subframes per image as\r\n     defined by MESS:SUBFRAME. Subframes are defined in the original\r\n     1024x1024 pixel MDIS coordinate system before pixel binning as described\r\n     by MESS:FPU_BIN and MESS:PIXELBIN.'),(14198,1,'APPROVED'),(14199,2,'ASCII_INTEGER'),(14200,3,'N/A'),(14201,4,'RANGE'),(14202,5,'0'),(14203,6,'1024'),(14204,10,'1'),(14205,7,'4'),(14206,8,'\r\n     The number of columns in the FIFTH rectangular subframe within an MDIS\r\n     image to be retained after image compression by the MESSENGER spacecraft\r\n     main processor (MP). There may be up to five subframes per image as\r\n     defined by MESS:SUBFRAME. Subframes are defined in the original\r\n     1024x1024 pixel MDIS coordinate system before pixel binning as\r\n     described by MESS:FPU_BIN and MESS:PIXELBIN.'),(14207,1,'APPROVED'),(14208,2,'ASCII_INTEGER'),(14209,3,'N/A'),(14210,4,'RANGE'),(14211,5,'0'),(14212,6,'1024'),(14213,10,'1'),(14214,7,'4'),(14215,8,'\r\n     The number of rows in the FIRST rectangular subframe within an MDIS\r\n     image to be retained after image compression by the MESSENGER\r\n     spacecraft main processor (MP). There may be up to five subframes per\r\n     image as defined by MESS:SUBFRAME. Subframes are defined in the\r\n     original 1024x1024 pixel MDIS coordinate system before pixel binning\r\n     as described by MESS:FPU_BIN and MESS:PIXELBIN.'),(14216,1,'APPROVED'),(14217,2,'ASCII_INTEGER'),(14218,3,'N/A'),(14219,4,'RANGE'),(14220,5,'0'),(14221,6,'1024'),(14222,10,'1'),(14223,7,'4'),(14224,8,'\r\n     The number of rows in the SECOND rectangular subframe within an MDIS\r\n     image to be retained after image compression by the MESSENGER\r\n     spacecraft main processor (MP). There may be up to five subframes per\r\n     image as defined by MESS:SUBFRAME. Subframes are defined in the\r\n     original 1024x1024 pixel MDIS coordinate system before pixel binning\r\n     as described by MESS:FPU_BIN and MESS:PIXELBIN.'),(14225,1,'APPROVED'),(14226,2,'ASCII_INTEGER'),(14227,3,'N/A'),(14228,4,'RANGE'),(14229,5,'0'),(14230,6,'1024'),(14231,10,'1'),(14232,7,'4'),(14233,8,'\r\n     The number of rows in the THIRD rectangular subframe within an MDIS\r\n     image to be retained after image compression by the MESSENGER\r\n     spacecraft main processor (MP). There may be up to five subframes per\r\n     image as defined by MESS:SUBFRAME. Subframes are defined in the\r\n     original 1024x1024 pixel MDIS coordinate system before pixel binning\r\n     as described by MESS:FPU_BIN and MESS:PIXELBIN.'),(14234,1,'APPROVED'),(14235,2,'ASCII_INTEGER'),(14236,3,'N/A'),(14237,4,'RANGE'),(14238,5,'0'),(14239,6,'1024'),(14240,10,'1'),(14241,7,'4'),(14242,8,'\r\n     The number of rows in the FOURTH rectangular subframe within an MDIS\r\n     image to be retained after image compression by the MESSENGER\r\n     spacecraft main processor (MP). There may be up to five subframes\r\n     per image as defined by MESS:SUBFRAME. Subframes are defined in the\r\n     original 1024x1024 pixel MDIS coordinate system before pixel binning\r\n     as described by MESS:FPU_BIN and MESS:PIXELBIN.'),(14243,1,'APPROVED'),(14244,2,'ASCII_INTEGER'),(14245,3,'N/A'),(14246,4,'RANGE'),(14247,5,'0'),(14248,6,'1024'),(14249,10,'1'),(14250,7,'4'),(14251,8,'\r\n     The number of rows in the FIFTH rectangular subframe within an MDIS\r\n     image to be retained after image compression by the MESSENGER\r\n     spacecraft main processor (MP). There may be up to five subframes\r\n     per image as defined by MESS:SUBFRAME. Subframes are defined in the\r\n     original 1024x1024 pixel MDIS coordinate system before pixel\r\n     binning as described by MESS:FPU_BIN and MESS:PIXELBIN.'),(14252,1,'APPROVED'),(14253,2,'ASCII_INTEGER'),(14254,3,'N/A'),(14255,4,'RANGE'),(14256,5,'0'),(14257,6,'1023'),(14258,10,'1'),(14259,7,'4'),(14260,8,'\r\n     The zero-based starting column of the FIRST rectangular subframe within\r\n     an MDIS image to be retained after image compression by the MESSENGER\