pixel binning as described\r\n     by MESS:FPU_BIN and MESS:PIXELBIN.'),(14288,1,'APPROVED'),(14289,2,'ASCII_INTEGER'),(14290,3,'N/A'),(14291,4,'RANGE'),(14292,5,'0'),(14293,6,'1023'),(14294,10,'1'),(14295,7,'4'),(14296,8,'\r\n     The zero-based starting column of the FIFTH rectangular subframe within\r\n     an MDIS image to be retained after image compression by the MESSENGER\r\n     spacecraft main processor (MP). There may be up to five subframes per\r\n     image as defined by MESS:SUBFRAME. Subframes are defined in the\r\n     original 1024x1024 pixel MDIS coordinate system before pixel binning as\r\n     described by MESS:FPU_BIN and MESS:PIXELBIN.'),(14297,1,'APPROVED'),(14298,2,'ASCII_INTEGER'),(14299,3,'N/A'),(14300,4,'RANGE'),(14301,5,'0'),(14302,6,'1023'),(14303,10,'1'),(14304,7,'4'),(14305,8,'\r\n     The zero-based starting row of the FIRST rectangular subframe within\r\n     an MDIS image to be retained after image compression by the MESSENGER\r\n     spacecraft main processor (MP). There may be up to five subframes per\r\n     image as defined by MESS:SUBFRAME. Subframes are defined in the\r\n     original 1024x1024 pixel MDIS coordinate system before pixel binning\r\n     as described by MESS:FPU_BIN and MESS:PIXELBIN.'),(14306,1,'APPROVED'),(14307,2,'ASCII_INTEGER'),(14308,3,'N/A'),(14309,4,'RANGE'),(14310,5,'0'),(14311,6,'1023'),(14312,10,'1'),(14313,7,'4'),(14314,8,'\r\n     The zero-based starting row of the SECOND rectangular subframe within\r\n     an MDIS image to be retained after image compression by the MESSENGER\r\n     spacecraft main processor (MP). There may be up to five subframes per\r\n     image as defined by MESS:SUBFRAME. Subframes are defined in the\r\n     original 1024x1024 pixel MDIS coordinate system before pixel binning\r\n     as described by MESS:FPU_BIN and MESS:PIXELBIN.'),(14315,1,'APPROVED'),(14316,2,'ASCII_INTEGER'),(14317,3,'N/A'),(14318,4,'RANGE'),(14319,5,'0'),(14320,6,'1023'),(14321,10,'1'),(14322,7,'4'),(14323,8,'\r\n     The zero-based starting row of the THIRD rectangular subframe within\r\n     an MDIS image to be retained after image compression by the MESSENGER\r\n     spacecraft main processor (MP). There may be up to five subframes per\r\n     image as defined by MESS:SUBFRAME. Subframes are defined in the\r\n     original 1024x1024 pixel MDIS coordinate system before pixel binning\r\n     as described by MESS:FPU_BIN and MESS:PIXELBIN.'),(14324,1,'APPROVED'),(14325,2,'ASCII_INTEGER'),(14326,3,'N/A'),(14327,4,'RANGE'),(14328,5,'0'),(14329,6,'1023'),(14330,10,'1'),(14331,7,'4'),(14332,8,'\r\n     The zero-based starting row of the FOURTH rectangular subframe within\r\n     an MDIS image to be retained after image compression by the MESSENGER\r\n     spacecraft main processor (MP). There may be up to five subframes per\r\n     image as defined by MESS:SUBFRAME. Subframes are defined in the\r\n     original 1024x1024 pixel MDIS coordinate system before pixel binning\r\n     as described by MESS:FPU_BIN and MESS:PIXELBIN.'),(14333,1,'APPROVED'),(14334,2,'ASCII_INTEGER'),(14335,3,'N/A'),(14336,4,'RANGE'),(14337,5,'0'),(14338,6,'1023'),(14339,10,'1'),(14340,7,'4'),(14341,8,'\r\n     The zero-based starting row of the FIFTH rectangular subframe within\r\n     an MDIS image to be retained after image compression by the MESSENGER\r\n     spacecraft main processor (MP). There may be up to five subframes per\r\n     image as defined by MESS:SUBFRAME. Subframes are defined in the\r\n     original 1024x1024 pixel MDIS coordinate system before pixel binning\r\n     as described by MESS:FPU_BIN and MESS:PIXELBIN.'),(14342,1,'APPROVED'),(14343,2,'ASCII_INTEGER'),(14344,3,'N/A'),(14345,4,'DEFINITION'),(14346,5,'0'),(14347,6,'5'),(14348,10,'1'),(14349,7,'1'),(14350,8,'\r\n     Number of rectangular subframes within an MDIS image to be retained after\r\n     image compression by the MESSENGER spacecraft main processor (MP).\r\n     Subframes may overlap each other, and are defined in the original\r\n     1024x1024 pixel MDIS coordinate system before pixel binning as described\r\n     by MESS:FPU_BIN and MESS:PIXELBIN.  Either a full image may be specified,\r\n     or up to five discrete regions within the full image. In all cases, the\r\n     first four columns of the original 1024x1024 image, which are physically\r\n     masked and serve as a dark current reference, are downlinked as subframe\r\n     0, even if the full image case is described. Within the subframes,\r\n     pixel binning as described by MESS:FPU_BIN and MESS:PIXELBIN is performed.\r\n       0 - no subframes (full image)\r\n       1 - 1 subframe\r\n       2 - 2 subframes\r\n       3 - 3 subframes\r\n       4 - 4 subframes\r\n       5 - 5 subframes'),(14351,1,'APPROVED'),(14352,2,'ASCII_INTEGER'),(14353,3,'N/A'),(14354,4,'DEFINITION'),(14355,5,'0'),(14356,6,'3'),(14357,10,'1'),(14358,7,'1'),(14359,8,'\r\n     Source of the 1 Hz time pulse used in time-tagging MDIS images:\r\n       0 = Software\r\n       1 = Main Processor A (MP-A)\r\n       2 = Main Processor B (MP-B)\r\n       3 = Software.'),(14360,1,'APPROVED'),(14361,2,'ASCII_INTEGER'),(14362,3,'N/A'),(14363,4,'DEFINITION'),(14364,5,'0'),(14365,6,'32'),(14366,10,'1'),(14367,7,'2'),(14368,8,'\r\n     Commanded (lossy) wavelet compression ratio for an MDIS image:\r\n       0:  no wavelet compression (note:\r\n           this expands an 8 or 12 bit image\r\n           to 16 bits per pixel)\r\n       1:  \'1x\' compression (actually\r\n           lossless, with an indeterminate\r\n           ratio)\r\n       2:  2x compression\r\n       3:  3x compression\r\n       .\r\n       .\r\n       32: 32x compression.'),(14369,1,'APPROVED'),(14370,2,'CHARACTER'),(14371,3,'NONE'),(14372,4,'DEFINITION'),(14373,7,'70'),(14374,8,'\r\n     The meteorite_location_name provides the name of the region\r\n     or geographic feature where the meteorite was found.'),(14375,1,'APPROVED'),(14376,2,'CHARACTER'),(14377,3,'NONE'),(14378,4,'DEFINITION'),(14379,7,'40'),(14380,8,'\r\n     The meteorite_name element provides the name that is\r\n     assigned to a meteorite.  It is often derived from the name\r\n     of the place or geographic feature where the meteorite was\r\n     found.'),(14381,1,'APPROVED'),(14382,2,'IDENTIFIER'),(14383,3,'NONE'),(14384,4,'DYNAMIC'),(14385,7,'70'),(14386,8,'\r\n     The meteorite_sub_type element defines a subcategory of a\r\n     meteorite_type (see definition for meteorite_type). For\r\n     example, octahedrites are a subtype of iron meteorites.\r\n     Octahedrites contain 4 sets of parallel plates that\r\n     intersect with each other in a complex manner.'),(14387,9,'OCTAHEDRITES'),(14388,1,'APPROVED'),(14389,2,'CHARACTER'),(14390,3,'NONE'),(14391,4,'DYNAMIC'),(14392,7,'40'),(14393,8,'\r\n     The meteorite_type element defines which class a meteorite\r\n     belongs to based on the meteorite composition and physical\r\n     characteristics.'),(14394,9,'ACHONDRITE'),(14395,9,'CARBONACEOUS CHONDRITE'),(14396,9,'ENSTATITE CHONDRITE'),(14397,9,'IRON'),(14398,9,'ORDINARY CHONDRITE'),(14399,9,'STONY-IRON'),(14400,1,'APPROVED'),(14401,2,'CHARACTER'),(14402,3,'NONE'),(14403,4,'TEXT'),(14404,8,'\r\n     The method_desc element describes the method used to perform\r\n     a particular observation.'),(14405,1,'PENDING'),(14406,2,'REAL'),(14407,3,'NONE'),(14408,4,'RANGE'),(14409,5,'0'),(14410,8,'\r\n     The MID_JULIAN_DATE_VALUE provides the full Julian date\r\n     (i.e., including date fraction) of the mid-point of an observation\r\n     or event.  Julian dates are expressed as real numbers.\r\n      \r\n     Note that this keyword should contain the full Julian date,\r\n     not the modified Julian date.'),(14411,1,'APPROVED'),(14412,2,'REAL'),(14413,3,'DEG'),(14414,4,'RANGE'),(14415,5,'-180'),(14416,6,'360'),(14417,8,'\r\n     The midnight_longitude element identifies the longitude on\r\n     the target body at which midnight was occurring at the time\r\n     of the start of an observation sequence.\r\n     Midnight_longitude is used to assist in geometry\r\n     calculations.\r\n     Note:  The coordinate_system_type data element should be used in\r\n     conjunction with this data element.'),(14418,1,'APPROVED'),(14419,2,'CHARACTER'),(14420,3,'NONE'),(14421,4,'DYNAMIC'),(14422,7,'60'),(14423,8,'\r\n     The mineral_name element provides the name assigned to a\r\n     mineral.  The name is usually chosen by the person who\r\n     first identified and described the mineral.'),(14424,9,'ALBITE'),(14425,9,'ANORTHITE'),(14426,9,'CARBON BLACK'),(14427,9,'DIOPSIDE'),(14428,9,'ENSTATITE'),(14429,9,'FELDSPAR'),(14430,9,'GRAPHITE'),(14431,9,'MAGNETITE'),(14432,9,'NICKEL'),(14433,9,'OLIVINE'),(14434,9,'TROILITE'),(14435,1,'APPROVED'),(14436,2,'CONTEXTDEPENDENT'),(14437,3,'NONE'),(14438,4,'RANGE'),(14439,7,'20'),(14440,8,'\r\n     The minimum element indicates the smallest value occurring\r\n     in a given instance of the data object.\r\n     Note:  For PDS and Mars Observer applications -- because of\r\n     the unconventional data type of this data element, the\r\n     element should appear in labels only within an explicit\r\n     object, i.e. anywhere between an \'OBJECT =\' and an\r\n     \'END_OBJECT\'.'),(14441,1,'APPROVED'),(14442,2,'REAL'),(14443,3,'NONE'),(14444,4,'RANGE'),(14445,8,'\r\n     The minimum_available_sampling_interval element identifies\r\n     the finest sampling at which a particular set of data is\r\n     available.\r\n     For example, magnetometer data are available in various\r\n     sampling intervals ranging from 1.92 seconds to 96 seconds.\r\n      Thus, for magnetometer data the value of the\r\n     minimum_available_sampling_interval would be 1.92.\r\n     Note: The unit of measure for the sampling interval is\r\n     provided by the unit element.'),(14446,1,'APPROVED'),(14447,2,'REAL'),(14448,3,'DEG'),(14449,4,'NONE'),(14450,5,'0'),(14451,6,'360'),(14452,8,'\r\n      The minimum_B1950_ring_longitude element specifies the\r\n     minimum inertial longitude within a ring area relative to\r\n     the B1950 prime meridian, rather than to the J2000 prime\r\n     meridian.  The prime meridian is the ascending node of the\r\n     planet\'s invariable plane on the Earth\'s mean equator of\r\n     B1950.  Longitudes are measured in the direction of orbital\r\n     motion along the planet\'s invariable plane to the ring\'s\r\n     ascending node, and thence along the ring plane.\r\n     Note:  For areas that cross the prime meridian, the minimum\r\n     ring longitude will have a value greater than the maximum ring\r\n     longitude.'),(14453,1,'APPROVED'),(14454,2,'REAL'),(14455,3,'K'),(14456,4,'RANGE'),(14457,5,'2.4'),(14458,8,'\r\n     The minimum_brightness_temperature element provides the\r\n     minimum brightness temperature value measured within a\r\n     given set of data or a given sequence.\r\n     Brightness temperature is the temperature of an ideal\r\n     blackbody whose radiant energy in a particular wavelength\r\n     range is the same as that of an observed object or feature.'),(14459,1,'APPROVED'),(14460,2,'CHARACTER'),(14461,3,'NONE'),(14462,4,'NONE'),(14463,7,'4'),(14464,8,'\r\n     The minimum_channel_id element provides an identification of\r\n     the lowest energy channel from which PLS instrument data is\r\n     telemetered to Earth while the instrument is operating in a\r\n     particular mode in a given frame.  Each mode consists of a\r\n     specific number of energy/charge channels which sequentially\r\n     measure current, but information from all measured channels\r\n     may not be telemetered to Earth.'),(14465,1,'APPROVED'),(14466,2,'REAL'),(14467,3,'NONE'),(14468,4,'RANGE'),(14469,8,'\r\n     The minimum_column_value provides the minimum real value\r\n     currently allowed by the PDS catalog for a given table\r\n     element.  This value is updated when new limits are\r\n     discovered.\r\n     Note:  These elements are unique to a table and may have\r\n     different values depending on which table the element is\r\n     associated with.'),(14470,1,'APPROVED'),(14471,2,'REAL'),(14472,3,'DEG'),(14473,4,'RANGE'),(14474,5,'0'),(14475,6,'180'),(14476,8,'\r\n     The minimum_emission_angle element provides the minimum\r\n     emission angle value.  See emission_angle.'),(14477,1,'APPROVED'),(14478,2,'REAL'),(14479,3,'DEG'),(14480,4,'RANGE'),(14481,5,'0'),(14482,6,'180'),(14483,8,'\r\n     The minimum_incidence_angle element provides the minimum\r\n     incidence angle value.  See incidence_angle.'),(14484,1,'APPROVED'),(14485,2,'REAL'),(14486,3,'MS'),(14487,4,'RANGE'),(14488,8,'\r\n     The minimum_instrument_exposure_duration element provides\r\n     the minimum possible exposure time for the instrument mode\r\n     identified by the instrument_mode_id element.\r\n     See instrument_exposure_duration.'),(14489,1,'APPROVED'),(14490,2,'REAL'),(14491,3,'NONE'),(14492,4,'RANGE'),(14493,8,'\r\n     The minimum_instrument_parameter element provides an\r\n     instrument\'s minimum usefully detectable signal level for a\r\n     given instrument parameter.  This value indicates the\r\n     physical value corresponding to the minimum output\r\n     of an instrument.\r\n     The instrument parameter to which this relates is identified\r\n     by the instrument_parameter_name element.'),(14494,1,'APPROVED'),(14495,2,'REAL'),(14496,3,'DEG'),(14497,4,'RANGE'),(14498,5,'-273'),(14499,8,'\r\n     The minimum instrument_temperature element provides the minimum\r\n     temperature, in degrees Celcius, of an instrument or some part\r\n     of an instrument.'),(14500,1,'APPROVED'),(14501,2,'REAL'),(14502,3,'DEG'),(14503,4,'RANGE'),(14504,5,'-90'),(14505,6,'90'),(14506,8,'\r\n     The minimum_latitude element specifies the southernmost\r\n     latitude of a spatial area, such as a map, mosaic, bin,\r\n     feature, or region.  See latitude.'),(14507,1,'APPROVED'),(14508,2,'INTEGER'),(14509,3,'NONE'),(14510,4,'RANGE'),(14511,5,'1'),(14512,8,'\r\n     The minmum_length element supplies the minimum number of\r\n     units that are required for the representation of a data\r\n     element. This element is generally assigned a value of N/A\r\n     except in the case where a minimum number of units are\r\n     required for the value. For example a password may require\r\n     a minimum number of characters to be valid.'),(14513,1,'APPROVED'),(14514,2,'REAL'),(14515,3,'DEG'),(14516,4,'RANGE'),(14517,5,'-90'),(14518,6,'90'),(14519,8,'\r\n     The minimum_limb_angle element provides the minimum value\r\n     of the limb angle within a given set of data.  See\r\n     limb_angle.'),(14520,1,'APPROVED'),(14521,2,'REAL'),(14522,3,'LOCALDAY/24'),(14523,4,'RANGE'),(14524,5,'0'),(14525,6,'24'),(14526,8,'\r\n     The minimum_local_time element provides the minimum\r\n     local time of day on the target body, measured in hours\r\n     from local midnight.'),(14527,1,'APPROVED'),(14528,2,'REAL'),(14529,3,'DEG'),(14530,4,'RANGE'),(14531,5,'0'),(14532,6,'360'),(14533,8,'\r\n     The minimum_longitude element specifies the easternmost\r\n     (right_most) longitude of a spatial area, such as a map,\r\n     mosaic, bin, feature, or region.  See longitude.\r\n     Note:  The minimum longitude data element is obsolete and should no\r\n     longer be used.  The assumed coordinate system was planetographic for\r\n     prograde rotators (PDS Cartographic Standards V3.0).  See coordinate_\r\n     system_type, easternmost_longitude and westernmost_longitude.'),(14534,1,'APPROVED'),(14535,2,'REAL'),(14536,3,'NONE'),(14537,4,'RANGE'),(14538,8,'\r\n     The minimum_parameter element specifies the minimum\r\n     allowable value for a parameter input to a given data\r\n     processing program.\r\n     The parameter constrained by this value is identified by\r\n     the parameter_name element.'),(14539,1,'APPROVED'),(14540,2,'REAL'),(14541,3,'DEG'),(14542,4,'RANGE'),(14543,5,'0'),(14544,6,'180'),(14545,8,'\r\n     The minimum_phase_angle element provides the minimum phase\r\n     angle value.  See phase_angle.'),(14546,1,'APPROVED'),(14547,2,'REAL'),(14548,3,'KM'),(14549,4,'NONE'),(14550,5,'0'),(14551,8,'\r\n      The minimum_radial_resolution element indicates the\r\n     minimum (finest) radial distance over which changes in ring\r\n     properties can be detected within a data product.'),(14552,1,'APPROVED'),(14553,2,'REAL'),(14554,3,'KM'),(14555,4,'NONE'),(14556,5,'0'),(14557,8,'\r\n      The minimum_radial_sampling_interval element indicates the\r\n     minimum radial spacing between consecutive points in a ring\r\n     profile.  In practice, this may be somewhat smaller than\r\n     the minimum_radres element because the profile\r\n     may be over-sampled.'),(14558,1,'APPROVED'),(14559,2,'REAL'),(14560,3,'DEG'),(14561,4,'NONE'),(14562,5,'0'),(14563,6,'360'),(14564,8,'\r\n      The minimum_ring_longitude element specifies the minimum\r\n     inertial longitude of a ring area relative to the prime\r\n     meridian.  In planetary ring systems, the prime meridian is\r\n     the ascending node of the planet\'s invariable plane on the\r\n     Earth\'s mean equator of J2000.  Longitudes are measured in\r\n     the direction of orbital motion along the planet\'s\r\n     invariable plane to the ring\'s ascending node, and thence\r\n     along the ring plane.\r\n     Note:  For areas that cross the prime meridian, the minimum ring\r\n     longitude will have a value greater than the maximum ring longitude.\r\n     Note:  The invariable plane of a planet is equivalent to its equatorial\r\n     plane for every ringed planet except Neptune.'),(14565,1,'APPROVED'),(14566,2,'REAL'),(14567,3,'KM'),(14568,4,'NONE'),(14569,5,'0'),(14570,8,'\r\n      The minimum_ring_radius element indicates the minimum\r\n     (innermost) radial location of an area within a planetary\r\n     ring system.  Radii are measured from the center of the\r\n     planet along the nominal ring plane.'),(14571,1,'APPROVED'),(14572,2,'REAL'),(14573,3,'NONE'),(14574,4,'RANGE'),(14575,8,'\r\n     The minimum_sampling_parameter element identifies the\r\n     minimum value at which a given data item was sampled.\r\n     For example, a spectrum that was measured in the 0.4 to 3.5\r\n     micrometer spectral region would have a\r\n     minimum_sampling_parameter value of 0.4.\r\n     The sampling parameter constrained by this value is\r\n     identified by the sampling_parameter_name element.\r\n     Note: The unit of measure for the sampling parameter is\r\n     provided by the unit element.'),(14576,1,'APPROVED'),(14577,2,'REAL'),(14578,3,'KM'),(14579,4,'RANGE'),(14580,8,'\r\n     The minimum_slant_distance element provides the minimum\r\n     slant distance value.  See slant_distance.'),(14581,1,'APPROVED'),(14582,2,'REAL'),(14583,3,'NONE'),(14584,4,'RANGE'),(14585,5,'0'),(14586,6,'1'),(14587,8,'\r\n     The minimum_solar_band_albedo element provides the minimum\r\n     solar band albedo value measured within a given set of data\r\n     or a given sequence.'),(14588,1,'APPROVED'),(14589,2,'REAL'),(14590,3,'K'),(14591,4,'RANGE'),(14592,8,'\r\n     The minimum_spectral_contrast element provides the minimum\r\n     value of spectral contrast within a given set of data.  See\r\n     spectral_contrast_ range.'),(14593,1,'APPROVED'),(14594,2,'REAL'),(14595,3,'BAR'),(14596,4,'RANGE'),(14597,8,'\r\n     The minimum_surface_pressure element provides the minimum\r\n     surface pressure value for the atmosphere of a given body.'),(14598,1,'APPROVED'),(14599,2,'REAL'),(14600,3,'K'),(14601,4,'RANGE'),(14602,5,'2.4'),(14603,8,'\r\n     The minimum_surface_temperature element provides the minimum\r\n     equatorial surface temperature value for a given body during\r\n     its year.'),(14604,1,'APPROVED'),(14605,2,'REAL'),(14606,3,'MICRON'),(14607,4,'RANGE'),(14608,8,'\r\n     The minimum_wavelength element identifies the minimum wavelength at which\r\n     an observation can be made or was made.  For instruments, this may depend\r\n     on the instrument detector or filter characteristics.  For data products,\r\n     this is the effective lower limit on the wavelength detected.'),(14609,1,'APPROVED'),(14610,2,'CONTEXTDEPENDENT'),(14611,3,'NONE'),(14612,4,'RANGE'),(14613,7,'20'),(14614,8,'\r\n     The missing_constant element supplies the value used to indicate that\r\n     no data were available.\r\n      \r\n     Note: The MISSING_CONSTANT element should appear only within an\r\n     explicit object definition -- i.e. anywhere between an \'OBJECT =\'\r\n     and an \'END_OBJECT\'. MISSING_CONSTANT assumes the data type of its\r\n     parent object.'),(14615,1,'APPROVED'),(14616,2,'INTEGER'),(14617,3,'N/A'),(14618,4,'RANGE'),(14619,5,'0'),(14620,8,'\r\n     The MISSING_FRAMES element is the total number of frames that are missing\r\n     from a file.\r\n      \r\n     Note: For MARS EXPRESS, a frame, which is also called a \'row\', is eight\r\n     lines of data. Each line, in turn, is composed of a sync marker followed by\r\n     a group of blocks (GOB). This refers to the Data Compression Electronics\r\n     (DCE) frames.'),(14621,1,'APPROVED'),(14622,2,'INTEGER'),(14623,3,'NONE'),(14624,4,'RANGE'),(14625,5,'0'),(14626,8,'\r\n     The missing_lines element is the total number of lines of data missing from\r\n     an image or observation when it was received on Earth. Note: For Cassini,\r\n     this provides the number of missing or incomplete lines of image data.'),(14627,9,'N/A'),(14628,1,'APPROVED'),(14629,2,'CHARACTER'),(14630,3,'NONE'),(14631,4,'STATIC'),(14632,10,'2'),(14633,7,'3'),(14634,8,'\r\n     The missing_packet_flag element indicates whether or not there were\r\n     telemetry packets that were expected but not received.'),(14635,9,'NO'),(14636,9,'YES'),(14637,1,'APPROVED'),(14638,2,'INTEGER'),(14639,3,'NONE'),(14640,4,'RANGE'),(14641,5,'0'),(14642,8,'\r\n     The missing_pixels element provides the number of pixels missing from an\r\n     image or observation. Note: For Cassini, this refers to the core of a\r\n     spectral cube, which indicates that the expected number of pixels (as\r\n     determined by the commanded cube dimensions) did not arrive. The positions\r\n     of these pixels are filled with CORE_NULL. Pixels purposefully set to\r\n     CORE_NULL (e.g., due to time insertion) are not included in this total.'),(14643,9,'N/A'),(14644,1,'APPROVED'),(14645,2,'INTEGER'),(14646,3,'NONE'),(14647,4,'RANGE'),(14648,5,'0'),(14649,8,'\r\n     The MISSING_SCAN_LINES element is the total number of scan lines\r\n     missing from an image or observation when it was received on Earth.'),(14650,1,'APPROVED'),(14651,2,'CHARACTER'),(14652,3,'NONE'),(14653,4,'DYNAMIC'),(14654,7,'60'),(14655,8,'\r\n      \r\n     The mission_alias_name element provides an official name of\r\n     a mission  used during the initial design, implementation,\r\n     or prelaunch phases. Example values: mission_name:MAGELLAN,\r\n     mission_alias_name:VENUS RADAR MAPPER. The mission_alias_name\r\n     element accepts set notation for multiple values.'),(14656,9,'A12'),(14657,9,'A14'),(14658,9,'A15'),(14659,9,'CASSINI'),(14660,9,'CH1'),(14661,9,'CLEMENTINE 1'),(14662,9,'COMET IMPACT 94'),(14663,9,'CONTOUR'),(14664,9,'DAWN'),(14665,9,'DI'),(14666,9,'EPOXI'),(14667,9,'GALILEO EUROPA MISSION (GEM)'),(14668,9,'GALILEO MILLENNIUM MISSION (GMM)'),(14669,9,'GEM'),(14670,9,'HAYABUSA'),(14671,9,'HUBBLE SPACE TELESCOPE'),(14672,9,'HUYGENS'),(14673,9,'INTERNATIONAL SOLAR POLAR MISSION'),(14674,9,'INTERNATIONAL SUN-EARTH EXPLOR'),(14675,9,'INTERNATIONAL UV EXPLORER'),(14676,9,'IRAS'),(14677,9,'JUPITER ORBITER-PROBE (JOP)'),(14678,9,'LCROSS'),(14679,9,'LRO'),(14680,9,'MARINER 10'),(14681,9,'MARINER 6 & 7'),(14682,9,'MARINER 6 AND 9'),(14683,9,'MARINER 9'),(14684,9,'MARS ENVIRONMENTAL SURVEY'),(14685,9,'MARS ENVIRONMENTAL SURVEY (MESUR PATHFINDER)'),(14686,9,'MESS'),(14687,9,'MEX'),(14688,9,'MGS'),(14689,9,'MJS77'),(14690,9,'MRO'),(14691,9,'MS-T5'),