,(24632,9,'THEBE'),(24633,9,'THRYM'),(24634,9,'TIESCHITZ'),(24635,9,'TITAN'),(24636,9,'TITANIA'),(24637,9,'TOURINNES-LA-GROSSE'),(24638,9,'TRES-2'),(24639,9,'TRES-3'),(24640,9,'TRITON'),(24641,9,'U RINGS'),(24642,9,'U12 PORTIA'),(24643,9,'U13 ROSALIND'),(24644,9,'U16 CALIBAN'),(24645,9,'U17 SYCORAX'),(24646,9,'UMBRIEL'),(24647,9,'UNK'),(24648,9,'URANUS'),(24649,9,'UTRECHT'),(24650,9,'VAVILOVKA'),(24651,9,'VEGA'),(24652,9,'VENUS'),(24653,9,'VERAMIN'),(24654,9,'VIGARANO'),(24655,9,'WARRENTON'),(24656,9,'WASP-3'),(24657,9,'WINDSOCK'),(24658,9,'XO-2'),(24659,9,'XO-3'),(24660,9,'YMIR'),(24661,9,'ZAVID'),(24662,9,'ZHOVTNEVYI'),(24663,1,'APPROVED'),(24664,2,'TIME'),(24665,3,'NONE'),(24666,4,'NONE'),(24667,7,'30'),(24668,8,'\r\n     The target_parameter_epoch element provides the reference\r\n     epoch for the value associated with a particular target\r\n     parameter, whose name is provided in the\r\n     target_parameter_name element. The reference epoch is the\r\n     date and time associated with measurement of a quantity\r\n     which may vary with time.  For example, the value provided\r\n     for the obliquity of a planet will be given for a\r\n     measurement taken at a specified time.  That time will be\r\n     referenced in the target_parameter_epoch element.  See also\r\n     target_parameter_value.'),(24669,1,'APPROVED'),(24670,2,'CHARACTER'),(24671,3,'NONE'),(24672,4,'STATIC'),(24673,7,'30'),(24674,8,'\r\n     The target_parameter_name element provides the name of\r\n     a dynamic or physical parameter associated with a given\r\n     target.  This element may take as values only those\r\n     names that are proper element names for the various\r\n     dynamic and physical parameters cataloged as part of\r\n     target information.  Example values:  BOND_ALBEDO,\r\n     MEAN_SURFACE_TEMPERATURE, OBLIQUITY,\r\n     ORBITAL_INCLINATION.'),(24675,9,'A AXIS RADIUS'),(24676,9,'ALL'),(24677,9,'ASCENDING NODE LONGITUDE'),(24678,9,'B AXIS RADIUS'),(24679,9,'BOND ALBEDO'),(24680,9,'C AXIS RADIUS'),(24681,9,'EQUATORIAL RADIUS'),(24682,9,'FLATTENING'),(24683,9,'MAGNETIC MOMENT'),(24684,9,'MASS'),(24685,9,'MASS DENSITY'),(24686,9,'MEAN RADIUS'),(24687,9,'MEAN SOLAR DAY'),(24688,9,'N/A'),(24689,9,'OBLIQUITY'),(24690,9,'ORBITAL ECCENTRICITY'),(24691,9,'ORBITAL INCLINATION'),(24692,9,'ORBITAL SEMIMAJOR AXIS'),(24693,9,'PERIAPSIS ARGUMENT ANGLE'),(24694,9,'POLE DECLINATION'),(24695,9,'POLE RIGHT ASCENSION'),(24696,9,'REVOLUTION PERIOD'),(24697,9,'SIDEREAL ROTATION PERIOD'),(24698,9,'SURFACE GRAVITY'),(24699,9,'UNK'),(24700,1,'APPROVED'),(24701,2,'CHARACTER'),(24702,3,'NONE'),(24703,4,'DEFINITION'),(24704,7,'40'),(24705,8,'\r\n     The target_parameter_uncertainty element provides the\r\n     numeric value of the uncertainty associated with the value\r\n     given for a particular target parameter, whose name is\r\n     provided in the associated target_parameter_name element.\r\n     The uncertainty is expressed in the same units as the value\r\n     of the parameter itself, and gives some measure of the\r\n     provider\'s estimate of the reliability of a particular value\r\n     stored in the catalog. See also target_parameter_value.'),(24706,9,'0.00014'),(24707,9,'0.00016'),(24708,9,'0.0002'),(24709,9,'0.0005'),(24710,9,'0.0008'),(24711,9,'0.0012'),(24712,9,'0.01'),(24713,9,'0.02'),(24714,9,'0.11'),(24715,9,'0.2E-5'),(24716,9,'1.'),(24717,9,'10.'),(24718,9,'15.'),(24719,9,'20.'),(24720,9,'30.'),(24721,9,'4.'),(24722,9,'6.'),(24723,9,'7.'),(24724,9,'N/A'),(24725,9,'UNK'),(24726,9,'UPPER LIMIT'),(24727,1,'APPROVED'),(24728,2,'CHARACTER'),(24729,3,'NONE'),(24730,4,'NONE'),(24731,7,'40'),(24732,8,'\r\n     The target_parameter_value element provides the numeric\r\n     value associated with a particular target parameter, whose\r\n     name is provided in the associated target_parameter_name\r\n     element.  Each value provided is associated with a\r\n     particular source, which is completely referenced in the\r\n     associated data_source_desc. See also\r\n     target_parameter_uncertainty, target_parameter_epoch.'),(24733,1,'PENDING'),(24734,2,'REAL'),(24735,3,'KM'),(24736,4,'RANGE'),(24737,8,'\r\n     The TARGET_SUN_POSITION_VECTOR element provides the\r\n     x-, y-, z- components of the position vector from\r\n     the target to the sun expressed in J2000 coordinates,\r\n     and corrected for light time and stellar aberration,\r\n     evaluated at the epoch at which the image was taken.'),(24738,1,'PENDING'),(24739,2,'REAL'),(24740,3,'KM/S'),(24741,4,'RANGE'),(24742,8,'\r\n     The TARGET_SUN_VELOCITY_VECTOR element indicates the x-, y-, z-\r\n     components of the velocity vector of the target relative to the\r\n     sun, expressed in J2000 coordinates, and corrected for light time,\r\n     evaluated at the epoch at which the image was taken.'),(24743,1,'APPROVED'),(24744,2,'IDENTIFIER'),(24745,3,'NONE'),(24746,4,'STATIC'),(24747,7,'20'),(24748,8,'\r\n     The target_type element identifies the type of a named\r\n     target.\r\n     Example values:  PLANET, SATELLITE, RING, REGION, FEATURE,\r\n     ASTEROID, COMET.'),(24749,9,'ASTEROID'),(24750,9,'CALIBRATION'),(24751,9,'COMET'),(24752,9,'DUST'),(24753,9,'GALAXY'),(24754,9,'GLOBULAR CLUSTER'),(24755,9,'METEORITE'),(24756,9,'METEOROID'),(24757,9,'METEOROID STREAM'),(24758,9,'METEOROID_STREAM'),(24759,9,'N/A'),(24760,9,'NEBULA'),(24761,9,'OPEN CLUSTER'),(24762,9,'PLANET'),(24763,9,'PLANETARY NEBULA'),(24764,9,'PLANETARY SYSTEM'),(24765,9,'PLANETARY_SYSTEM'),(24766,9,'PLASMA CLOUD'),(24767,9,'REFERENCE'),(24768,9,'RING'),(24769,9,'SATELLITE'),(24770,9,'STAR'),(24771,9,'STAR CLUSTER'),(24772,9,'SUN'),(24773,9,'TERRESTRIAL SAMPLE'),(24774,9,'TRANS-NEPTUNIAN OBJ'),(24775,1,'APPROVED'),(24776,2,'CHARACTER'),(24777,3,'NONE'),(24778,4,'DYNAMIC'),(24779,7,'40'),(24780,8,'\r\n     The task_name element identifies the task with which an\r\n     individual is or was affiliated during his or her\r\n     association with a particular institution.\r\n     Note: \'task\' affiliations are distinct from\r\n     \'mission\' affiliations.'),(24781,9,'DATA RECOVERY AND ANALYSIS'),(24782,9,'GROUP LEADER'),(24783,9,'GRSFE'),(24784,9,'N/A'),(24785,9,'PLANETARY DATA SYSTEM'),(24786,9,'RESEARCH STAFF'),(24787,9,'UNK'),(24788,9,'VIKING'),(24789,1,'APPROVED'),(24790,2,'IDENTIFIER'),(24791,3,'NONE'),(24792,4,'SUGGESTED'),(24793,7,'12'),(24794,8,'\r\n     The technical_support_type element indicates the type of support\r\n     provided for a piece of software. SOURCE_NAME = PDS CN/S. Hughes.'),(24795,9,'FULL'),(24796,9,'ONE_TIME'),(24797,9,'PROTOTYPE'),(24798,1,'PENDING'),(24799,2,'CHARACTER'),(24800,3,'NONE'),(24801,4,'NONE'),(24802,7,'10'),(24803,8,'\r\n     The TELEMETRY_APPLICATION_ID element is used to link a data product\r\n     (file) to a given application or structure description, when multiple\r\n     formats exist within a single telemetry format.'),(24804,1,'APPROVED'),(24805,2,'CHARACTER'),(24806,3,'NONE'),(24807,4,'DEFINITION'),(24808,10,'1'),(24809,7,'5'),(24810,8,'\r\n     The TELEMETRY_FMT_EXTENSION_TYPE element provides additional\r\n     information about what kind of telemetry was collected during\r\n     scene looks versus calibration looks. Valid values are:\r\n        LONG (Scene: Long Telemetry, Calibration: Long Telemetry)\r\n        SHORT (Scene: Short Telemetry, Calibration: Short Telemetry)\r\n        MIXED (Scene: Short Telemetry, Calibration: Long Telemetry)'),(24811,1,'APPROVED'),(24812,2,'IDENTIFIER'),(24813,3,'NONE'),(24814,4,'STATIC'),(24815,7,'4'),(24816,8,'\r\n     The TELEMETRY_FORMAT_ID element supplies a telemetry format\r\n     code.'),(24817,9,'301'),(24818,9,'302'),(24819,9,'303'),(24820,9,'304'),(24821,9,'AI8'),(24822,9,'ALL'),(24823,9,'BDT'),(24824,9,'BK5'),(24825,9,'BPB'),(24826,9,'BPT'),(24827,9,'EHR'),(24828,9,'ELS'),(24829,9,'ESS'),(24830,9,'HCA'),(24831,9,'HCJ'),(24832,9,'HCM'),(24833,9,'HIM'),(24834,9,'HIS'),(24835,9,'HMA'),(24836,9,'HPB'),(24837,9,'HPJ'),(24838,9,'HPW'),(24839,9,'HRW'),(24840,9,'IM4'),(24841,9,'IM8'),(24842,9,'LNR'),(24843,9,'LPB'),(24844,9,'LPU'),(24845,9,'LPW'),(24846,9,'LRS'),(24847,9,'MPB'),(24848,9,'MPP'),(24849,9,'MPR'),(24850,9,'MPW'),(24851,9,'PW4'),(24852,9,'PW8'),(24853,9,'RAW'),(24854,9,'RCP'),(24855,9,'RWR'),(24856,9,'SCI'),(24857,9,'SPT'),(24858,9,'XCM'),(24859,9,'XED'),(24860,9,'XPB'),(24861,9,'XPN'),(24862,9,'XPW'),(24863,9,'XRW'),(24864,1,'PENDING'),(24865,2,'CHARACTER'),(24866,3,'N/A'),(24867,4,'SUGGESTED'),(24868,8,'\r\n     The TELEMETRY_PROVIDER_ID element identifies the provider and or\r\n     version of the telemetry data used in the generation of this data.'),(24869,9,'SSW MER_DP'),(24870,9,'TTACS'),(24871,1,'PENDING'),(24872,2,'CHARACTER'),(24873,3,'N/A'),(24874,4,'SUGGESTED'),(24875,7,'12'),(24876,8,'\r\n     The TELEMETRY_PROVIDER_TYPE element classifies the source\r\n     of the telemetry used in creation of this data set.'),(24877,9,'TDS'),(24878,1,'APPROVED'),(24879,2,'IDENTIFIER'),(24880,3,'N/A'),(24881,4,'DYNAMIC'),(24882,10,'1'),(24883,7,'40'),(24884,8,'\r\n     The telemetry source identifier element identifies the telemetry (TLM)\r\n     source. Normally, the telemetry from the spacecraft is routed through a\r\n     dedicated channel into the user workstation.  All of these elements in the\r\n     TLM source may, however, be different over the lifecycle of a mission,\r\n     e.g., the spacecraft flight model 1 and flight model 2 (FM1, FM2) or an\r\n     electrical model (EM) might be used to send the data via a virtual channel\r\n     0 (VC0) or virtual channel 1 (VC1) to a electrical ground support equipment\r\n     (EGSE) computer 0 (EGSE_ID_0). The different routes can be defined with the\r\n     telemetry source id element.\r\n      \r\n     Examples (substitute quotes instead of apostrophe in the below example):\r\n     TELEMETRY_SOURCE_ID = (\'FM1\',\'VC0\',\'EGSE_ID_1\')\r\n     TELEMETRY_SOURCE_ID = (\'EM\',\'VC1\',\'EGSE_ID_1\')'),(24885,9,'EGSE_ID_0'),(24886,9,'EGSE_ID_1'),(24887,9,'EM'),(24888,9,'FM0'),(24889,9,'FM1'),(24890,9,'VC0'),(24891,9,'VC1'),(24892,1,'PENDING'),(24893,2,'CHARACTER'),(24894,3,'N/A'),(24895,4,'DYNAMIC'),(24896,10,'1'),(24897,7,'60'),(24898,8,'\r\n       The TELEMETRY_SOURCE NAME element identifies the telemetry\r\n       source used in creation of a data set.'),(24899,1,'PENDING'),(24900,2,'CHARACTER'),(24901,3,'N/A'),(24902,4,'SUGGESTED'),(24903,8,'\r\n     The TELEMETRY_SOURCE_TYPE element classifies the source\r\n     of the telemetry used in creation of this data set.'),(24904,9,'DATA PRODUCT'),(24905,9,'SFDU'),(24906,1,'APPROVED'),(24907,2,'CHARACTER'),(24908,3,'NONE'),(24909,4,'NONE'),(24910,7,'30'),(24911,8,'\r\n     The telephone_number element provides the area code,\r\n     telephone number and extension (if any) of an individual or\r\n     node.  See also:  fts_number.'),(24912,1,'APPROVED'),(24913,2,'REAL'),(24914,3,'M'),(24915,4,'RANGE'),(24916,8,'\r\n     The telescope_diameter element provides the diameter of the\r\n     primary mirror of a telescope.'),(24917,1,'APPROVED'),(24918,2,'REAL'),(24919,3,'NONE'),(24920,4,'RANGE'),(24921,5,'0.5'),(24922,8,'\r\n     The telescope_f_number element provides the value of the\r\n     ratio of the focal length to the aperture of a telescope.'),(24923,1,'APPROVED'),(24924,2,'REAL'),(24925,3,'M'),(24926,4,'RANGE'),(24927,8,'\r\n     The telescope_focal_length element provides the total\r\n     optical path distance from the first element of the optics\r\n     to the focal point of a telescope.'),(24928,1,'APPROVED'),(24929,2,'IDENTIFIER'),(24930,3,'NONE'),(24931,4,'DYNAMIC'),(24932,7,'60'),(24933,8,'\r\n     The telescope_id element uniquely identifies a particular\r\n     telescope.'),(24934,9,'A'),(24935,9,'B'),(24936,9,'C'),(24937,9,'D'),(24938,9,'IRS'),(24939,9,'ISS-NA'),(24940,9,'ISS-WA'),(24941,9,'MAWD'),(24942,9,'N/A'),(24943,9,'VISA'),(24944,9,'VISB'),(24945,1,'APPROVED'),(24946,2,'REAL'),(24947,3,'DEG'),(24948,4,'NONE'),(24949,5,'-90'),(24950,6,'90'),(24951,8,'\r\n     The telescope_latitude element indicates the planetographic\r\n     latitude of a telescope site on the Earth\'s surface.'),(24952,1,'APPROVED'),(24953,2,'REAL'),(24954,3,'DEG'),(24955,4,'NONE'),(24956,5,'-180'),(24957,6,'180'),(24958,8,'\r\n      The telescope_longitude element indicates the longitude of\r\n     a telescope site on the Earth\'s surface.  East longitudes\r\n     are positive and west longitudes are negative.'),(24959,1,'APPROVED'),(24960,2,'REAL'),(24961,3,'RAD'),(24962,4,'RANGE'),(24963,5,'0'),(24964,6,'3.14159'),(24965,8,'\r\n     The telescope_resolution element provides the achievable\r\n     angular resolution of a telescope.'),(24966,1,'APPROVED'),(24967,2,'CHARACTER'),(24968,3,'NONE'),(24969,4,'NONE'),(24970,7,'20'),(24971,8,'\r\n     The telescope_serial_number element provides the serial\r\n     number of a telescope.'),(24972,1,'APPROVED'),(24973,2,'REAL'),(24974,3,'KM'),(24975,4,'NONE'),(24976,5,'0'),(24977,8,'\r\n      The telescope_site_radius element indicates the radial\r\n     distance of a telescope site from the Earth\'s center.'),(24978,1,'APPROVED'),(24979,2,'REAL'),(24980,3,'NONE'),(24981,4,'RANGE'),(24982,5,'0.5'),(24983,8,'\r\n     The telescope_t_number element provides the effective\r\n     f_number of a telescope.\r\n     Note:  The t_number differs from the f_number due to\r\n     losses in the optical system.'),(24984,1,'APPROVED'),(24985,2,'REAL'),(24986,3,'NONE'),(24987,4,'RANGE'),(24988,8,'\r\n     The telescope_t_number_error element indicates the error\r\n     associated with the t_number value for a particular\r\n     telescope.'),(24989,1,'APPROVED'),(24990,2,'REAL'),(24991,3,'NONE'),(24992,4,'RANGE'),(24993,5,'0'),(24994,6,'1'),(24995,8,'\r\n     The telescope_transmittance element provides the\r\n     transmittance value for a telescope.  Transmittance is\r\n     defined as the ratio of transmitted to incident flux\r\n     through the telescope.'),(24996,1,'APPROVED'),(24997,2,'CHARACTER'),(24998,3,'NONE'),(24999,4,'TEXT'),(25000,8,'\r\n     The temperature_translation_desc element provides\r\n     the conversion necessary to translate an instrument\'s\r\n     transmitted temperature reading to a value which is\r\n     relative to a standard temperature scale.'),(25001,1,'APPROVED'),(25002,2,'CHARACTER'),(25003,3,'NONE'),(25004,4,'DEFINITION'),(25005,7,'30'),(25006,8,'\r\n     The template element provides the identifier that appears in\r\n     a physical template header.'),(25007,1,'APPROVED'),(25008,2,'CHARACTER'),(25009,3,'NONE'),(25010,4,'NONE'),(25011,7,'12'),(25012,8,'\r\n     The template_bl_name element represents the data base terse\r\n     name associated with a template keyword.  This tersename is\r\n     used during construction of templates to provide a reference\r\n     to the keyword\r\n     a full data element name rather than the terse\r\n     representation.  The formulation of the tmpltblname is\r\n     governed by rules and abbreviations as defined in the PDS\r\n      Data Administration Plan document.'),(25013,1,'APPROVED'),(25014,2,'CHARACTER'),(25015,3,'NONE'),(25016,4,'NONE'),(25017,7,'60'),(25018,8,'\r\n     The template_name element provides the name of a template\r\n     object used in the PDS system and the bulk loading software.'),(25019,1,'APPROVED'),(25020,2,'CHARACTER'),(25021,3,'NONE'),(25022,4,'TEXT'),(25023,8,'\r\n     The template_note element provides the textual description\r\n     of the purpose for a template object as related to the data\r\n     supplier.  This description is distributed whenever a\r\n     template is sent to a data supplier.'),(25024,1,'APPROVED'),(25025,2,'DATE'),(25026,3,'NONE'),(25027,4,'FORMATION'),(25028,7,'10'),(25029,8,'\r\n      \r\n     The template_revision_date element indicates the latest\r\n     revision date for a template (i.e. 1988-11-22).'),(25030,1,'APPROVED'),(25031,2,'CHARACTER'),(25032,3,'NONE'),(25033,4,'NONE'),(25034,7,'40'),(25035,8,'\r\n     The template_status element is updated by the loader\r\n     software after certain events in the catalog loading\r\n     process.  The value of this field indicates the current\r\n     status of a template or sub-template in the load process.'),(25036,1,'APPROVED'),(25037,2,'CHARACTER'),(25038,3,'NONE'),(25039,4,'NONE'),(25040,7,'12'),(25041,8,'\r\n     The template_type element provides a type or class of\r\n     template object.'),(25042,1,'APPROVED'),(25043,2,'CHARACTER'),(25044,3,'NONE'),(25045,4,'NONE'),(25046,7,'1'),(25047,8,'\r\n     The template_use_indicator element indicates whether or not\r\n     template may recur within a set of templates.'),(25048,1,'APPROVED'),(25049,2,'CHARACTER'),(25050,3,'NONE'),(25051,4,'NONE'),(25052,7,'12'),(25053,8,'\r\n     The terse_name element supplies a twelve-character unique\r\n     identifier for a data element and is an alternative to the\r\n     thirty-character data element name.  In the PDS, the terse\r\n     name is an abbreviation of the data element name, according\r\n     to the abbreviations documented in the Planetary Science\r\n     Data Dictionary.'),(25054,1,'PENDING'),(25055,2,'CHARACTER'),(25056,3,'N/A'),(25057,4,'SUGGESTED'),(25058,8,'\r\n     The TEST_PHASE_NAME element identifies the\r\n     phase of a test for instrument calibration.'),(25059,9,'CALIBRATION'),(25060,9,'CHECKOUT'),(25061,9,'DEVELOPMENT'),(25062,9,'INTEGRATION AND TEST'),(25063,1,'APPROVED'),(25064,2,'CHARACTER'),(25065,3,'NONE'),(25066,4,'STATIC'),(25067,7,'3'),(25068,8,'\r\n     The state of the Cassini UVIS instrument\'s test pulse mechanism.'),(25069,9,'OFF'),(25070,9,'ON'),(25071,1,'APPROVED'),(25072,2,'CHARACTER'),(25073,3,'NONE'),(25074,4,'STATIC'),(25075,7,'1'),(25076,8,'\r\n     The text_flag element indicates whether or not a data\r\n     element contains variable-length textual information (i.e.,\r\n     a description, a note, or a summary).'),(25077,9,'N'),(25078,9,'Y'),(25079,1,'APPROVED'),(25080,2,'INTEGER'),(25081,3,'US_DOLLAR'),(25082,4,'RANGE'),(25083,5,'0'),(25084,8,'\r\n     The threshold_cost element provides the maximum cost which\r\n     is compared to the order item\'s calculated cost.  When the\r\n     threshold cost is exceeded, the order item is not accepted\r\n     by the PDS order function.'),(25085,1,'APPROVED'),(25086,2,'CHARACTER'),(25087,3,'NONE'),(25088,4,'DYNAMIC'),(25089,7,'20'),(25090,8,'\r\n     The time_from_closest_approach element provides the time with respect\r\n     to periapsis or closest approach.'),(25091,1,'APPROVED'),(25092,2,'TIME'),(25093,3,'NONE'),(25094,4,'DYNAMIC'),(25095,7,'30'),(25096,8,'\r\n     The time_range number is unique to AMMOS-MGN ephemeris files\r\n     and identifies groups of time ranges in the catalog object.'),(25097,1,'PENDING'),(25098,2,'INTEGER'),(25099,3,'S'),(25100,4,'RANGE'),(25101,5,'0'),(25102,8,'\r\n     The TIMEOUT_PARAMETER element provides the time at which an operation\r\n     will timeout.\r\n      \r\n     Note: For MER, this is the revolve timeout for grinding. If the\r\n     grinding doesn\'t complete a full revolution within this time it will\r\n     determine that it is not making sufficient progress and end the\r\n     grinding.'),(25103,1,'APPROVED'),(25104,2,'CHARACTER'),(25105,3,'NONE'),(25106,4,'STATIC'),(25107,10,'4'),(25108,7,'5'),(25109,8,'\r\n      The tlm_cmd_discrepancy_flag element indicates whether or not\r\n     discrepancies were found between the uplinked commands and the\r\n     downlinked telemetry.'),(25110,9,'FALSE'),(25111,9,'TRUE'),(25112,1,'APPROVED'),(25113,2,'INTEGER'),(25114,3,'NONE'),(25115,4,'RANGE'),(25116,5,'0'),(25117,8,'\r\n     The TLM_INST_DATA_HEADER_ID element indicates the version of the\r\n     instrument specific information provided with telemetry data\r\n     products.  The version is incremented whenever there is a change\r\n     to the header structure.'),(25118,1,'PENDING'),(25119,2,'REAL'),(25120,3,'N/A'),(25121,4,'SUGGESTED'),(25122,8,'\r\n     The element TORQUE_CONSTANT specifies\r\n     the rotation motor torque constant of an...\r\n     (this description incomplete at this time)\r\n      \r\n     Valid UNIT_ID is : mN*m/mA'),(25123,1,'PENDING'),(25124,2,'REAL'),(25125,3,'N/A'),(25126,4,'SUGGESTED'),(25127,8,'\r\n     The element TORQUE_GAIN specifies the torque controller\r\n     proportional gain, derivative and integral gain.\r\n      \r\n     Valid UNIT_IDs are:	\r\n      rad/(sec*m N*m)\r\n      rad/(mN*m)\r\n      rad*sec/(mN *m)'),(25128,1,'PENDING'),(25129,2,'CHARACTER'),(25130,3,'N/A'),(25131,4,'SUGGESTED'),(25132,8,'\r\n     The TORQUE_GAIN_NAME element specifies the\r\n     formal name of the TORQUE_GAIN element.'),(25133,9,'DERIVATIVE'),(25134,9,'INTEGRAL'),(25135,9,'PROPORTIONAL'),(25136,1,'APPROVED'),(25137,2,'INTEGER'),(25138,3,'NONE'),(25139,4,'RANGE'),(25140,5,'0'),(25141,8,'\r\n     The total_fovs (fields-of-view) element indicates the total\r\n     number of fields of view associated with a single section of\r\n     an instrument.'),(25142,1,'APPROVED'),(25143,2,'INTEGER'),(25144,3,'NONE'),(25145,4,'RANGE'),(25146,5,'0'),(25147,8,'\r\n     The TOTAL_RESCAN_NUMBER is the total number of rescan lines acquired.'),(25148,1,'APPROVED'),(25149,2,'CHARACTER'),(25150,3,'NONE'),(25151,4,'TEXT'),(25152,8,'\r\n     The transfer_command_text element represents the complete\r\n     command used to create a data volume, such as COPY or\r\n     BACKUP for tape volumes.  It should also include special\r\n     flags that were used to perform the command (eg. tar -xvf).'),(25153,1,'PENDING'),(25154,2,'CHARACTER'),(25155,3,'NONE'),(25156,4,'DYNAMIC'),(25157,10,'1'),(25158,7,'60'),(25159,8,'\r\n     Polarization of a signal transmitted by the instrument or other source.'),(25160,9,'CIRCULAR'),(25161,9,'ELLIPTICAL'),(25162,9,'HORIZONTAL'),(25163,9,'LEFT CIRCULAR'),(25164,9,'LEFT ELLIPTICAL'),(25165,9,'LINEAR'),(25166,9,'PARALLEL'),(25167,9,'PERPENDICULAR'),(25168,9,'RIGHT CIRCULAR'),(25169,9,'RIGHT ELLIPTICAL'),(25170,9,'VERTICAL'),(25171,1,'APPROVED'),(25172,2,'REAL'),(25173,3,'DEG'),(25174,4,'RANGE'),(25175,5,'0'),(25176,6,'360'),(25177,8,'\r\n     The true_anomaly_angle element provides the value of the angle between\r\n     the line connecting an orbiting body and the body around which it is\r\n     orbiting (its primary) and the line connecting the periapsis position\r\n     and the primary.  True_anomaly is measured in the orbiting body\'s\r\n     orbital plane in the direction of motion from periapsis.'),(25178,1,'APPROVED'),(25179,2,'INTEGER'),(25180,3,'PIXEL'),(25181,4,'DYNAMIC'),(25182,8,'\r\n      Galileo Solid State Imaging-specific. Images can be edited so that\r\n     only an image area or cut_out_window is compressed and transmitted to\r\n     Earth. Within this cut_out_window there can be an image area or\r\n     TRUTH_WINDOW of up to 96 X 96 pixels that will be transmitted with only\r\n     lossless Huffman compression applied. The truth_window element\r\n     indicates the location and size of this image area as defined by four\r\n     numbers: starting line, starting sample, number of lines, number of\r\n     samples (the origin of the image coordinate system is at\r\n     line,sample=1,1 for the upper-left corner with samples increasing to\r\n     the right and lines increasing down).'),(25183,1,'APPROVED'),(25184,2,'INTEGER'),(25185,3,'NONE'),(25186,4,'RANGE'),(25187,5,'0'),(25188,8,'\r\n     The tuple_sequence_number element is used in all text\r\n     tables where the ordering of the ASCII text rows is\r\n     required.  This element is used in all text type tables in\r\n     the PDS data base.'),(25189,1,'APPROVED'),(25190,2,'REAL'),(25191,3,'DEG'),(25192,4,'RANGE'),(25193,5,'0'),(25194,6,'360'),(25195,8,'\r\n     The twist_angle element provides the angle of rotation about an\r\n     optical axis relative to celestial coordinates. The RIGHT_ASCENSION,\r\n     DECLINATION and TWIST_ANGLE elements define the pointing direction\r\n     and orientation of an image or scan platform.\r\n     Note: The specific mathematical definition of TWIST_ANGLE depends on\r\n           the value of the TWIST_ANGLE_TYPE element. If unspecified,\r\n           TWIST_ANGLE_TYPE = GALILEO for Galileo data and\r\n     TWIST_ANGLE_TYPE = DEFAULT for all other data.\r\n      \r\n     Note: This element bears a simple relationship to the value of\r\n           CELESTIAL_NORTH_CLOCK_ANGLE.\r\n           When TWIST_ANGLE_TYPE = DEFAULT,\r\n                TWIST_ANGLE = (180 - CELESTIAL_NORTH_CLOCK_ANGLE) mod 360;\r\n           when TWIST_ANGLE_TYPE = GALILEO,\r\n                TWIST_ANGLE = (270 - CELESTIAL_NORTH_CLOCK_ANGLE) mod 360.'),(25196,1,'APPROVED'),(25197,2,'IDENTIFIER'),(25198,3,'NONE'),(25199,4,'STATIC'),(25200,7,'10'),(25201,8,'\r\n     The twist_angle_type element determines the specific mathematical\r\n     meaning of the element TWIST_ANGLE when it is used to specify the\r\n     pointing of an image or scan platform. Allowed values are DEFAULT and\r\n     GALILEO. If unspecified, the value is GALILEO for Galileo data and\r\n     DEFAULT for all other data.\r\n      \r\n     The three elements RIGHT_ASCENSION,\r\n     DECLINATION and TWIST_ANGLE define the C-matrix, which transforms a\r\n     3-vector in celestial coordinates into a frame fixed to an image plane.\r\n     Celestial coordinates refer to a frame in which the x-axis points\r\n     toward the First Point of Aries and the z-axis points to the celestial\r\n     pole; these coordinates are assumed to be in J2000 unless otherwise\r\n     specified. Image plane coordinates are defined such that the x-axis\r\n     points right, the y-axis points down, and the z-axis points along the\r\n     camera\'s optic axis, when an image is displayed as defined by the\r\n     SAMPLE_DISPLAY_DIRECTION and LINE_DISPLAY_DIRECTION elements.\r\n      \r\n     For TWIST_ANGLE_TYPE = DEFAULT, the C-matrix is equal to\r\n       C-matrix = [T]3 [90-D]1 [R+90]3\r\n      \r\n      = |-sinR cosT-cosR sinD sinT  cosR cosT-sinR sinD sinT  cosD sinT|\r\n        | sinR sinT-cosR sinD cosT -cosR sinT-sinR sinD cosT  cosD cosT|\r\n        |        cosR cosD                 sinR cosD             sinD  |\r\n      \r\n     For TWIST_ANGLE_TYPE = GALILEO, the C-matrix is defined by\r\n       C-matrix = [T]3 [90-D]2 [R]3\r\n      \r\n      = | sinR sinT+cosR sinD cosT  cosR sinT+sinR sinD cosT  -cosD cosT|\r\n        |-sinR cosT-cosR sinD sinT  cosR cosT-sinR sinD sinT   cosD sinT|\r\n        |        cosR cosD               sinR cosD               sinD   |\r\n      \r\n     Here the notation [X]n specifies a rotation about the nth axis by\r\n     angle X (in degrees). R refers to right ascension, D to declination,\r\n     and T to twist angle.'),(25202,9,'DEFAULT'),(25203,9,'GALILEO'),(25204,1,'APPROVED'),(25205,2,'REAL'),(25206,3,'DEG'),(25207,4,'RANGE'),(25208,5,'-90'),(25209,6,'90'),(25210,8,'\r\n     The twist_offset_angle element provides the angle at which\r\n     an instrument is mounted, measured perpendicular to the\r\n     plane defined by the cone and cross-cone axes.\r\n     See also cone_offset_angle and cross_cone_offset_angle.'),(25211,1,'APPROVED'),(25212,2,'CHARACTER'),(25213,3,'NONE'),(25214,4,'FORMATION'),(25215,10,'3'),(25216,7,'40'),(25217,8,'\r\n      \r\n     The UNCOMPRESSED_FILE_NAME element provides the location independent name\r\n     of a file.  It excludes node or volume location, directory path names, and\r\n     version specification.  To promote portability across multiple platforms,\r\n     PDS requires the file_name to be limited to a 36-character basename, a\r\n     full stop (. period), and a 3-character extension.  Valid characters\r\n     include capital letters A - Z, numerals 0 - 9, and the underscore character\r\n     (_).'),(25218,1,'APPROVED'),(25219,2,'REAL'),(25220,3,'KM'),(25221,4,'RANGE'),(25222,8,'\r\n      The uncorrected_distance_to_nadir element provides the\r\n     \'raw\' measurement of range-to-surface, obtained from the\r\n     pulse-compressed altimeter signals by the MGMTAC phase of\r\n     the altimetry and radiometry data reduction program.'),(25223,1,'APPROVED'),(25224,2,'TIME'),(25225,3,'NONE'),(25226,4,'DEFINITION'),(25227,7,'30'),(25228,8,'\r\n     The uncorrected_start_time element provides the time of the\r\n     observation as sent down by the spacecraft. This time may\r\n     be incorrect due to a software problem that existed onboard\r\n     the spacecraft.  The difference between the START_TIME and\r\n     the UNCORRECTED_START_TIME is the estimated correction that\r\n     was applied to the START_TIME during ground processing.'),(25229,1,'APPROVED'),(25230,2,'CHARACTER'),(25231,3,'NONE'),(25232,4,'STATIC'),(25233,7,'3'),(25234,8,'\r\n     The uneven_bit_weight_corr_flag element is used to indicate\r\n     whether a correction has been applied to adjust for uneven\r\n     bit weighting of the analog-to-digital converter. In image\r\n     processing, the correction is applied to every pixel in an\r\n     image.'),(25235,9,'OFF'),(25236,9,'ON'),(25237,1,'APPROVED'),(25238,2,'CHARACTER'),(25239,3,'NONE'),(25240,4,'NONE'),(25241,7,'40'),(25242,8,'\r\n     The unit element provides the full name or standard\r\n     abbreviation of a unit of measurement in which a value is\r\n     expressed.  Example values: square meter, meter per second.\r\n     Note:  A table of standard units representing those\r\n     published by the Systeme Internationale appears in the\r\n     \'Units of Measurement\' section of the PSDD.  (Please refer\r\n     to the table of contents for its location.)  The values\r\n     in this table\'s \'Unit Name\' column constitute the standard\r\n     values for the data element UNIT.'),(25243,1,'APPROVED'),(25244,2,'CHARACTER'),(25245,3,'NONE'),(25246,4,'NONE'),(25247,7,'60'),(25248,8,'\r\n      \r\n     The unit_id element indicates the common abbreviation or\r\n     symbol for a unit of measure.  Example:  The unit KILOGRAM\r\n     has the unit_id \'kg\'.\r\n     Note:  A table of standard units, unit ids, and measured\r\n     quantities including those published by the Systeme\r\n     Internationale appears in the \'Units of Measurement\'\r\n     section of the PSDD.  (Please refer to the table of contents\r\n     for its location.)  The values in this table\'s \'Symbol\'\r\n     column constitute the standard values for the data element\r\n     unit_id.'),(25249,1,'APPROVED'),(25250,2,'CONTEXTDEPENDENT'),(25251,3,'NONE'),(25252,4,'DEFINITION'),(25253,7,'20'),(25254,8,'\r\n     The unknown_constant element supplies the numeric value\r\n     used to represent the figurative constant \'UNK\'. \'UNK\'\r\n     (Unknown) is defined as indicating when values for a\r\n     particular data element in a specific instance is\r\n     permanently not known.'),(25255,1,'APPROVED'),(25256,2,'CHARACTER'),(25257,3,'NONE'),(25258,4,'NONE'),(25259,7,'60'),(25260,8,'\r\n     The upload_id element describes a spacecraft command set\r\n     that is associated with the given data product.'),(25261,1,'APPROVED'),(25262,2,'CHARACTER'),(25263,3,'NONE'),(25264,4,'TEXT'),(25265,8,'\r\n     The usage_note element provides the information about the\r\n     use of a particular data element or object within a\r\n     particular context.'),(25266,1,'APPROVED'),(25267,2,'CHARACTER'),(25268,3,'NONE'),(25269,4,'NONE'),(25270,7,'30'),(25271,8,'\r\n     The user_product_id element provides an\r\n     alternate logical file name constructed according to a\r\n     producer-defined naming convention.'),(25272,1,'APPROVED'),(25273,2,'CONTEXTDEPENDENT'),(25274,3,'NONE'),(25275,4,'RANGE'),(25276,7,'20'),(25277,8,'\r\n     The valid_maximum data element represents the maximum value\r\n     that is valid for a data object.  Valid_minimum and valid_\r\n     maximum define the valid range of values for a data object,\r\n     such as -90 to 90 for a column object containing latitude\r\n     values.\r\n     Note:  this element should appear in labels only between\r\n     the \'OBJECT =\' and \'END_OBJECT=\' lines of an object with a\r\n     specific data type.'),(25278,1,'APPROVED'),(25279,2,'CONTEXTDEPENDENT'),(25280,3,'NONE'),(25281,4,'RANGE'),(25282,7,'20'),(25283,8,'\r\n     The valid_minimum data element represents the minimum value\r\n     that is valid for a data object.  Valid_minimum and valid_\r\n     maximum define the valid range of values for a data object,\r\n     such as -90 to 90 for a column object containing latitude\r\n     values.\r\n     Note:  this element should appear in labels only between\r\n     the \'OBJECT =\' and \'END_OBJECT=\' lines of an object with a\r\n     specific data type.'),(25284,1,'APPROVED'),(25285,2,'IDENTIFIER'),(25286,3,'N/A'),(25287,4,'STATIC'),(25288,10,'1'),(25289,7,'30'),(25290,8,'\r\n     Tables with variable length records\r\n     may be stored in two files, with the fixed-length fields in one file and\r\n     the variable-length fields in the other, usually named *.VAR. In a COLUMN\r\n     object, the presence of the keywords VAR_DATA_TYPE, VAR_ITEM_BYTES, and\r\n     VAR_RECORD_TYPE indicates that the column\'s value is an offset into a\r\n     variable length record in the *.VAR file. VAR_DATA_TYPE specifies the data\r\n     type of the data found at the location in the *.VAR file. It is analogous\r\n     to the keyword DATA_TYPE.'),(25291,9,'ASCII_COMPLEX'),(25292,9,'ASCII_INTEGER'),(25293,9,'ASCII_REAL'),(25294,9,'BINARY_CODED_DECIMAL'),(25295,9,'BIT_STRING'),(25296,9,'BOOLEAN'),(25297,9,'CHARACTER'),(25298,9,'COMPLEX'),(25299,9,'DATE'),(25300,9,'EBCDIC_CHARACTER'),(25301,9,'FLOAT'),(25302,9,'IBM_COMPLEX'),(25303,9,'IBM_INTEGER'),(25304,9,'IEEE_COMPLEX'),(25305,9,'IEEE_REAL'),(25306,9,'INTEGER'),(25307,9,'LSB_BIT_STRING'),(25308,9,'LSB_INTEGER'),(25309,9,'LSB_UNSIGNED_INTEGER'),(25310,9,'MAC_COMPLEX'),(25311,9,'MAC_INTEGER'),(25312,9,'MAC_REAL'),(25313,9,'MAC_UNSIGNED_INTEGER'),(25314,9,'MSB_BIT_STRING'),(25315,9,'MSB_INTEGER'),(25316,9,'MSB_UNSIGNED_INTEGER'),(25317,9,'N/A'),(25318,9,'PC_COMPLEX'),(25319,9,'PC_INTEGER'),(25320,9,'PC_REAL'),(25321,9,'PC_UNSIGNED_INTEGER'),(25322,9,'REAL'),(25323,9,'SUN_COMPLEX'),(25324,9,'SUN_INTEGER'),(25325,9,'SUN_REAL'),(25326,9,'SUN_UNSIGNED_INTEGER'),(25327,9,'TIME'),(25328,9,'UNSIGNED_INTEGER'),(25329,9,'VAXG_COMPLEX'),(25330,9,'VAXG_REAL'),(25331,9,'VAX_BIT_STRING'),(25332,9,'VAX_COMPLEX'),(25333,9,'VAX_DOUBLE'),(25334,9,'VAX_INTEGER'),(25335,9,'VAX_REAL'),(25336,9,'VAX_UNSIGNED_INTEGER'),(25337,1,'APPROVED'),(25338,2,'INTEGER'),(25339,3,'B'),(25340,4,'N/A'),(25341,5,'1'),(25342,8,'\r\n     Tables with variable length records\r\n     may be stored in two files, with the fixed-length fields in one file and\r\n     the variable-length fields in the other, usually named *.VAR. In a COLUMN\r\n     object, the presence of the keywords VAR_DATA_TYPE, VAR_ITEM_BYTES, and\r\n     VAR_RECORD_TYPE indicates that the column\'s value is an offset into a\r\n     variable length record in the *.VAR file. VAR_ITEM_BYTES specifies the\r\n     number of bytes of data found at the location in the *.VAR file. It is\r\n     analogous to the keyword BYTES.'),(25343,1,'APPROVED'),(25344,2,'CHARACTER'),(25345,3,'N/A'),(25346,4,'DYNAMIC'),(25347,10,'1'),(25348,7,'40'),(25349,8,'\r\n     Tables with variable length records\r\n     may be stored in two files, with the fixed-length fields in one file and\r\n     the variable-length fields in the other, usually named *.VAR. In a COLUMN\r\n     object, the presence of the keywords VAR_DATA_TYPE, VAR_ITEM_BYTES, and\r\n     VAR_RECORD_TYPE indicates that the column\'s value is an offset into a\r\n     variable length record in the *.VAR file. VAR_RECORD_TYPE specifies the\r\n     type of variable length records in the *.VAR file.'),(25350,1,'APPROVED'),(25351,2,'REAL'),(25352,3,'NONE'),(25353,4,'RANGE'),(25354,8,'\r\n     The vector_component_1 element provides the magnitude of\r\n     the first component of a vector.\r\n     The particular vector component being measured is\r\n     identified by the vector_component_id_1\r\n     element.'),(25355,1,'APPROVED'),(25356,2,'REAL'),(25357,3,'NONE'),(25358,4,'RANGE'),(25359,8,'\r\n     The vector_component_2 element provides the magnitude of\r\n     the second component of a vector.\r\n     The particular vector component being measured is\r\n     identified by the vector_component_id_2\r\n     element.'),(25360,1,'APPROVED'),(25361,2,'REAL'),(25362,3,'NONE'),(25363,4,'RANGE'),(25364,8,'\r\n     The vector_component_3 element provides the magnitude of\r\n     the third component of a vector.\r\n     The particular vector component being measured is\r\n     identified by the vector_component_id_3\r\n     element.'),(25365,1,'APPROVED'),(25366,2,'IDENTIFIER'),(25367,3,'NONE'),(25368,4,'DYNAMIC'),(25369,7,'8'),(25370,8,'\r\n     The vector_component_id element identifies a\r\n     vector component without reference to a particular vector\r\n     component value.'),(25371,9,'CLST_LAT'),(25372,9,'CLST_LNG'),(25373,9,'DECLNATN'),(25374,9,'ESL_X'),(25375,9,'ESL_Y'),(25376,9,'ESL_Z'),(25377,9,'GAMMA'),(25378,9,'ICC_X'),(25379,9,'ICC_Y'),(25380,9,'ICC_Z'),(25381,9,'LAT'),(25382,9,'LATJ$-3'),(25383,9,'LATS$-3'),(25384,9,'LATU$-3'),(25385,9,'LONG'),(25386,9,'LONJ$-3'),(25387,9,'LONS$-3'),(25388,9,'LONU$-3'),(25389,9,'PHI'),(25390,9,'PVO_X'),(25391,9,'PVO_Y'),(25392,9,'PVO_Z'),(25393,9,'R'),(25394,9,'RADIUS'),(25395,9,'RHO'),(25396,9,'RJ$'),(25397,9,'RS$'),(25398,9,'RU$'),(25399,9,'R_ASCNSN'),(25400,9,'SIGMA'),(25401,9,'THETA'),(25402,9,'V'),(25403,9,'VPHI'),(25404,9,'VR'),(25405,9,'VRHO'),(25406,9,'VSO_X'),(25407,9,'VSO_Y'),(25408,9,'VSO_Z'),(25409,9,'VZ'),(25410,9,'WX'),(25411,9,'WY'),(25412,9,'WZ'),(25413,9,'W_LONG'),(25414,9,'X'),(25415,9,'XE'),(25416,9,'XS'),(25417,9,'Y'),(25418,9,'YE'),(25419,9,'YS'),(25420,9,'Z'),(25421,9,'ZE'),(25422,9,'ZS'),(25423,1,'APPROVED'),(25424,2,'IDENTIFIER'),(25425,3,'NONE'),(25426,4,'DYNAMIC'),(25427,7,'8'),(25428,8,'\r\n     The vector_component_id_1 element identifies\r\n     the first component of a vector.\r\n     The magnitude of the first component of the vector is\r\n     provided by the vector_component_1 element.\r\n     Example value:  RJ\\$ (a radial distance).'),(25429,9,'RJ$'),(25430,9,'RS$'),(25431,9,'RU$'),(25432,1,'APPROVED'),(25433,2,'IDENTIFIER'),(25434,3,'NONE'),(25435,4,'DYNAMIC'),(25436,7,'8'),(25437,8,'\r\n     The vector_component_id_2 element identifies\r\n     the second component of a vector.\r\n     The magnitude of the second component of the vector is\r\n     provided by the vector_component_2 element.\r\n     Example value:  LATJ\\$S3 (a latitude).'),(25438,9,'LATJ$-3'),(25439,9,'LATS$-3'),(25440,9,'LATU$-3'),(25441,1,'APPROVED'),(25442,2,'IDENTIFIER'),(25443,3,'NONE'),(25444,4,'DYNAMIC'),(25445,7,'8'),(25446,8,'\r\n     The vector_component_id_3 element identifies\r\n     the third component of a vector.\r\n     The magnitude of the third component of the vector is\r\n     provided by the vector_component_3 element.\r\n     Example value:  LONJ\\$S3 (a longitude).'),(25447,9,'LONJ$-3'),(25448,9,'LONS$-3'),(25449,9,'LONU$-3'),(25450,1,'APPROVED'),(25451,2,'CHARACTER'),(25452,3,'NONE'),(25453,4,'DYNAMIC'),(25454,7,'12'),(25455,8,'\r\n     The vector_component_type element identifies the type of\r\n     information which is provided by a particular vector\r\n     component identification element.\r\n     Example values:  LATITUDE, LONGITUDE, VELOCITY.'),(25456,9,'DISTANCE'),(25457,9,'ISCC X'),(25458,9,'ISCC Y'),(25459,9,'ISCC Z'),(25460,9,'LATITUDE'),(25461,9,'LONGITUDE'),(25462,9,'RANGE'),(25463,9,'SSCC X'),(25464,9,'SSCC Y'),(25465,9,'SSCC Z'),(25466,9,'ULATITUDE'),(25467,9,'VELOCITY'),(25468,9,'X'),(25469,9,'Y'),(25470,9,'Z'),(25471,1,'APPROVED'),(25472,2,'CHARACTER'),(25473,3,'NONE'),(25474,4,'TEXT'),(25475,8,'\r\n     The vector_component_type_desc provides a\r\n     general description of a particular vector component\r\n     type.'),(25476,1,'APPROVED'),(25477,2,'CHARACTER'),(25478,3,'NONE'),(25479,4,'DYNAMIC'),(25480,7,'60'),(25481,8,'\r\n     The vector_component_unit element specifies the unit of\r\n     measure of associated dataset or sampling parameters.\r\n     For example, in the ring information entity the unit\r\n     element specifies that a given set of ring radii are\r\n     measured in kilometers.'),(25482,9,'AU'),(25483,9,'DEGREES'),(25484,9,'JOVIAN RADII (1RJ = 71398KM)'),(25485,9,'KM/S'),(25486,9,'N/A'),(25487,9,'PLANETARY RADII'),(25488,9,'RN (RN = 24,765KM)'),(25489,9,'RU (RU = 25,600KM)'),(25490,9,'SATURN RADII (1 RS = 60330 KM)'),(25491,9,'UNK'),(25492,9,'URANUS RADII (1 RU = 25600 KM)'),(25493,1,'APPROVED'),(25494,2,'CHARACTER'),(25495,3,'NONE'),(25496,4,'DYNAMIC'),(25497,8,'\r\n     This element is an alias for product_version_id used only by\r\n     AMMOS-MGN ephemeris files.'),(25498,1,'APPROVED'),(25499,2,'INTEGER'),(25500,3,'NONE'),(25501,4,'RANGE'),(25502,5,'0'),(25503,8,'\r\n     The version_number element is defined as an alias for\r\n     product_version_id and is available only for AMMOS-Magellan\r\n     mission operations products.'),(25504,1,'APPROVED'),(25505,2,'REAL'),(25506,3,'DEG'),(25507,4,'RANGE'),(25508,5,'0'),(25509,6,'360'),(25510,8,'\r\n     The vertical_field_of_view element provides the angular\r\n     measure of the vertical field of view of an instrument.'),(25511,1,'APPROVED'),(25512,2,'REAL'),(25513,3,'NONE'),(25514,4,'RANGE'),(25515,5,'1'),(25516,8,'\r\n     The vertical_framelet_offset element provides the column\r\n     number of a framelet within a tiled image.  In the PDS,\r\n     offsets are counted from one.'),(25517,1,'APPROVED'),(25518,2,'REAL'),(25519,3,'DEG'),(25520,4,'RANGE'),(25521,5,'0'),(25522,6,'360'),(25523,8,'\r\n     The vertical_pixel_field_of_view element provides the\r\n     angular measure of the vertical field of view of a single\r\n     pixel.'),(25524,1,'APPROVED'),(25525,2,'REAL'),(25526,3,'M/PIXEL'),(25527,4,'RANGE'),(25528,5,'0'),(25529,6,'1000000000'),(25530,8,'\r\n     The VERTICAL_PIXEL_SCALE element indicates the vertical\r\n     picture scale.'),(25531,1,'APPROVED'),(25532,2,'CHARACTER'),(25533,3,'NONE'),(25534,4,'TEXT'),(25535,8,'\r\n      The volume_desc element describes the content and type of\r\n     data contained in the volume.'),(25536,1,'APPROVED'),(25537,2,'IDENTIFIER'),(25538,3,'NONE'),(25539,4,'DYNAMIC'),(25540,7,'20'),(25541,8,'\r\n     The volume_format element identifies the logical format\r\n     used in writing a data volume, such as ANSI, TAR, or BACKUP\r\n     for tape volumes and ISO-9660, HIGH-SIERRA, for CD-ROM\r\n     volumes.'),(25542,9,'ANSI'),(25543,9,'HIGH-SIERRA'),(25544,9,'ISO-9660'),(25545,9,'ISO-9660_LEVEL1'),(25546,9,'ISO-9660_LEVEL2'),(25547,9,'NONE'),(25548,9,'TAR'),(25549,9,'UDF_ISO-9660_BRIDGE'),(25550,9,'VAX-BACKUP'),(25551,1,'APPROVED'),(25552,2,'IDENTIFIER'),(25553,3,'NONE'),(25554,4,'FORMATION'),(25555,7,'12'),(25556,8,'\r\n     The volume_id element provides a unique identifier for a\r\n     data volume.  Example: MG_1001.'),(25557,1,'APPROVED'),(25558,2,'CHARACTER'),(25559,3,'NONE'),(25560,4,'TEXT'),(25561,8,'\r\n     The volume_insert_text element provides a text field to be\r\n     included on the volume insert.  The text field should\r\n     identify the data products or data sets included on the\r\n     volume.  The text field should consist of 8 or fewer lines of\r\n     text where each line is no more than 60 characters wide.'),(25562,1,'APPROVED'),(25563,2,'CHARACTER'),(25564,3,'NONE'),(25565,4,'DEFINITION'),(25566,7,'60'),(25567,8,'\r\n     The volume_name element contains the name of a data volume.\r\n      In most cases the volume_name is more specific than the\r\n     volume_set_name.  For example, the volume_name for the\r\n     first volume in the VOYAGER IMAGES OF URANUS volume set is:\r\n     Volume 1: Compressed Images 24476.54 - 26439.58'),(25568,1,'APPROVED'),(25569,2,'CHARACTER'),(25570,3,'NONE'),(25571,4,'DYNAMIC'),(25572,7,'60'),(25573,8,'\r\n      \r\n     The volume_series_name element provide